Центр размещен на 4 этажах. В центре имеются: подземный гараж на 25 машино-мест, зрительный зал на 165 мест, конференц-зал, многофункциональный зал,  парикмахерская, компьютерный класс на 8 рабочих мест для лиц старшего возраста и  инвалидов, а также Совет ветеранов Мещанского района, который расположен на 2 этаже. 
	В зрительном зале в течение года проходит более 300 мероприятий, направленных на социокультурную реабилитацию лиц старшего поколения и лиц с ограниченными возможностями. 
Основной задачей Центра является организация и  проведение социальных, оздоровительных, реабилитационных, профилактических и иных мероприятий направленных на социальную поддержку и обслуживание граждан пожилого возраста, инвалидов, семей с детьми инвалидами, семей и других категорий граждан, попавших в трудную жизненную ситуацию.
