Виды деятельности Учреждения:
• Мониторинг социальной и демографической ситуации, уровня социально-экономического благополучия граждан на территории обслуживания.
• Выявление и дифференцированный учёт граждан, нуждающихся в социальной поддержке, определение необходимых им форм помощи и периодичности (постоянно, временно, на разовой основе) её предоставления.
• Нестационарное социальное обслуживание на дому граждан пожилого возраста и инвалидов, частично утративших способность к самообслуживанию.
• Нестационарное социально-медицинское обслуживание на дому граждан пожилого возраста и инвалидов, частично утративших способность к самообслуживанию.
• Социальный патронаж  граждан пожилого возраста и инвалидов, частично или полностью утративших способность к самообслуживанию.
• Предоставление адресной неотложной помощи разового характера гражданам, находящимся в трудной жизненной ситуации и остро нуждающимся в социальной поддержке.
• Нестационарное социальное обслуживание граждан пожилого возраста и инвалидов в форме дневного пребывания.
• Оказание разовых услуг «Мобильной социальной службой».
• Комплексная реабилитация инвалидов в нестационарной форме.
• Оказание гражданам социально-экономических, социально-педагогических, социально-правовых, социально-медицинских, социально-бытовых, социально-консультативных, санитарно-гигиенических, культурно-досуговых, консультативных услуг при условии соблюдения принципов адресной и преемственности помощи.
• Оказание услуг по обеспечению инвалидов, детей-инвалидов и лиц с ограничениями жизнедеятельности техническими средствами реабилитации.
• Проведение индивидуальной профилактической работы семьями с детьми.
• Социальное сопровождение выпускников интернатных учреждений, семей с детьми, находящихся в социально опасном положении.
• Привлечение государственных, муниципальных и негосударственных организаций и учреждений (здравоохранения, образования, миграционной службы, службы занятости и также общественных и религиозной службы, службы занятости и так далее), а также общественных и религиозных организаций и объединений к решению вопросов оказания социальной поддержки населению и координация их деятельности в этом направлении.
• Внедрение в практику новых форм и методов социального обслуживания в зависимости от характера нуждаемости населения в социальной поддержке и с учётом социально-экономического развития города Москвы.
• Учреждение выполняет государственное задание, которое в соответствии с перечисленными выше основными видами деятельности Учреждения, формируется и утверждается Учредителем.
