-Обеспечивает предоставление социальной помощи на дому лицам, нуждающимся в этом виде обслуживания, а также организует работу отделений приема граждан, обработки информации, анализа и прогнозирования; дневного пребывания граждан пожилого возраста, инвалидов и несовершеннолетних детей, социально-медицинского обслуживания, срочного социального обслуживания, социальной помощи семье и детям. 
- Участвует в разработке мероприятий по организации социального обслуживания и социальной защиты граждан пожилого возраста, инвалидов, семей с детьми и других категорий граждан.  
- Совместно с органами и учреждениями социальной защиты, здравоохранения, внутренних дел, занятости, миграции, общественными объединениями многодетных, неполных семей, семей с детьми-инвалидами и другими организациями выявляет граждан, нуждающихся в социальной защите, причины и факторы социального неблагополучия конкретных семей, граждан пожилого возраста и инвалидов и их потребности в социальной помощи.  
- Ведет учет граждан, нуждающихся в социальной поддержке и обслуживании.  
- Оказывает социальные услуги в объеме территориального перечня гарантированных государством социальных услуг.  
- Осуществляет социальное сопровождение семей и детей, нуждающихся в социальной помощи и поддержке.  
- Оказывает помощь семьям в решении вопросов по преодолению трудных жизненных ситуаций.  
- Оказывает социальную поддержку и осуществляет мероприятия и социальное сопровождение по адаптации детей-сирот и детей, оставшихся без попечения родителей, выпускников интернатных учреждений, в возрасте до 23 лет.  
- Проводит работу по профилактике безнадзорности несовершеннолетних, защите их прав, участвует в работе по предупреждению алкоголизма, наркомании среди несовершеннолетних.  
- Проводит анализ уровня социального обслуживания семей с детьми, граждан пожилого возраста и инвалидов, прогнозирует их потребности в социальной помощи и готовит предложения по развитию сферы социальных услуг.  
- Внедряет новые формы и виды социального обслуживания.  
- Проводит мероприятия по повышению профессионального уровня работников Центра.  
- Участвует в привлечении различных организаций к решению вопросов оказания социальной помощи пенсионерам, инвалидам, семьям с детьми и отдельным гражданам.  
- Информирует население по вопросам социального обслуживания пенсионеров, инвалидов, семей, детей и отдельных граждан. 
- Участвует в подготовке мобилизационных мероприятий в порядке, установленном нормативными правовыми актами Российской Федерации и города Москвы.
