Институт — государственное автономное учреждение, подведомственное Департаменту социальной защиты населения города Москвы. 
В Институте ведётся профессиональная переподготовка и повышение квалификации руководителей и специалистов системы социальной защиты населения Москвы.
Осуществляется подготовка кадрового резерва руководителей Районных управлений социальной защиты населения и учреждений социального обслуживания стационарного и нестационарного типов.
Проводится аттестация руководителей и специалистов учреждений системы социального обслуживания  населения города Москвы.
Введена система дистанционного обучения.
Изучение, обобщение и распространение передового опыта социальной защиты и социального обслуживания населения в Москве, других российских регионах, а также инновационных технологий предоставления социальных услуг.
Институт работает по лицензии Департамента образования города Москвы №029693 от 12.12.2011 на право образовательной деятельности.
18 октября 2010 года Институт прошел государственную аккредитацию в городской Службе лицензирования и аттестации образовательных учреждений, педагогических кадров и учащихся Департамента образования города Москвы (свидетельство о государственной аккредитации №010468 от 18.10.2010).
В декабре 2014 года, по итогам аудита и оценки, ИДПО вручён МЕЖДУНАРОДНЫЙ СЕРТИФИКАТ КАЧЕСТВА ISO 9001-2011 – сертификат соответствия системы менеджмента качества организации международным требованиям – ГОСТ ISO 9001-2011. ИДПО получил право на использование Знака соответствия Системы добровольной сертификации «Международный центр стандартизации и сертификации ISCO» сроком до 12.12.17., область сертификации: Образовательная деятельность.
Директор Института, доктор исторических наук, профессор Евдокия Ивановна Холостова известна в России и за рубежом как ученый, внесший фундаментальный вклад в научные дисциплины социальной политики и социальной работы. Она является одним из основателей нового научного направления в области теории социальной работы, суть которого в создании учебно-практических центров на базе общеобразовательных и профессиональных учреждений. Евдокия Ивановна разработала новую концепцию практико-ориентированной подготовки в высших учебных заведениях специалистов для социальной сферы. Анализ зарубежного опыта социального обслуживания с целью его адаптации и распространения в системе социальной защиты населения города Москвы; обмен информацией с организаторами и исследователями системы социальной защиты за рубежом.
Организация и проведение научных исследований, научно-методологических семинаров, конференций, симпозиумов с целью привлечения внимания профессионального сообщества и широкой общественности к острым социальным проблемам, нахождения путей, методов и технологий их решения.
Разработка и выпуск учебных, методических, аналитических и справочных материалов, в том числе в электронной форме. 
В Институте реализуются различные по уровню профессиональные образовательные программы: лицензия имеется на 65 программ повышения квалификации в объеме от 72 до 500 часов, 13 программ профессиональной переподготовки объемом свыше 500 часов. 
Всего с 2009 по 2014 год обучено более 27 000 человек,в том числе на бюджетной основе 12517 специалистов, в том числе по государственному заданию – 7552 человека.
По программам ИДПО обучаются специалисты из регионов (примерно 10% от общего числа слушателей).
Профессорско-преподавательский состав Института характеризуется тем, что доля докторов наук, профессоров и кандидатов наук в ИДПО в 3 раза выше, чем по нормативу для академических институтов.
В аспирантуре обучается 70 аспирантов и соискателей (внебюджет). В 2009-2014 гг. были защищены 4 докторские и 5 кандидатских диссертаций штатными сотрудниками Института.
Всего за 6 лет осуществлено 72 научных исследования (внебюджет). 
Доля среднегодового объема научных исследований в ИДПО в 5 раза выше, чем по нормативу для академических институтов.
Международное сотрудничество позволяет Институту привлекать ведущих зарубежных специалистов для обмена опытом работы, совместной разработки новых социальных технологий, а также для проведения мастер-классов по различным направлениям социальной работы. В 2009-2014 году Институт посетили представители Великобритании, Дании, Швеции, Германии, Франции, Словении, КНР, США.
В рамках заключенного 18 апреля 2014 года меморандума о двустороннем сотрудничестве 
с "Глобальным Институтом социальной работы" города Сингапура на базе ГАУ ИДПО ДСЗН открылась "Международная школа социальной работы".



