Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания "Южнопортовый" является правопреемником в отношении предмета, целей, прав, обязанностей и иных вопросов деятельности ГБУ ЦСО «Южнопортовый», ГБУ ЦСО «Лефортово», ГБУ ЦСО «Нижегородский».
Функции и полномочия учредителя Учреждения в соответствии с федеральными законами, законами города Москвы, нормативными правовыми актами Правительства Москвы осуществляет Департамент социальной защиты населения города Москвы.
