В 2011 году Детский дом успешно прошел государственную аттестацию, лицензирование и аккредитацию образовательного учреждения. В Детском доме идёт непрерывная работа по созданию максимально благоприятных условий для воспитания и обучения детей, оставшихся без родительского попечения. У нас работает более 40 педагогов, 80% имеют высшее педагогическое образование, более половины имеют первую и высшую квалификационную категорию. Все усилия коллектива направлены на решение главной задачи - вырастить детей гармонично развитыми людьми, нравственно, физически и психологически здоровыми, способными найти своё место в жизни. 
