Государственное бюджетное учреждение Центр социальной помощи семье и детям «Измайлово» располагается в отдельностоящем двухэтажном здании, общая площадь которого 547,7 м2.

 На территории Центра находится огороженный участок площадью 0,16 ГА. Тут располагается детская площадка нового образца, игровая площадка со специальным резиновым покрытием для проведения спортивных и иных мероприятий.

 В центре имеется прекрасно оборудованный актовый зал, площадью 214,10 м2. Имеется профессиональное  звуковое оборудование (суммарная мощность около 3 кВт), световое оборудование ведущих мировых брендов, что способствует проведению конференций на самом высоком уровне, детских праздников, дней рождений, смотров самодеятельности, театра и многого другого.

Для занятий с психологом в центре есть специально оборудованные  сенсорная и игровая комнаты.

