Деятельность центра осуществляется по следующим направлениям:

- выявление и учет семей с детьми, нуждающихся в социальной помощи и услугах;

- оказание помощи семьям по преодолению трудной жизненной ситуации или социально опасного положения;

- социальный патронаж семей с детьми, находящихся в трудной жизненной ситуации;

- оказание помощи родителям в воспитании детей и преодолении педагогических ошибок и конфликтных ситуаций с детьми;

- профилактика безнадзорности детей и подростков;

- работа с детьми и подростками по пропаганде здорового образа жизни, профилактика табакокурения, алкоголизма, наркомании;

- организация в отделениях дневного пребывания досуга детей и подростков, развитие творческих способностей в кружках, клубах по интересам, педагогическая коррекция, помощь в подготовке домашних заданий;

- содействие в организации семейного отдыха, экскурсионных поездок;

- социально-экономическая помощь (вещевая и продуктовая помощь, предоставление товаров длительного пользования). 
