Центр осуществляет свою деятельность под руководством Территориального центра социального обслуживания "Марьино", Управления социальной защиты населения Юго-Восточного административного округа города Москвы, Департамента социальной защиты населения города Москвы во взаимодействии с территориальными органами исполнительной власти, органами местного самоуправления и учреждениями социальной защиты, здравоохранения, образования, внутренних дел, общественными, благотворительными и другими организациями.

Основной задачей Центра является организация социального обслуживания и оказание социальных, оздоровительных, профилактических, консультативных и иных услуг помощи гражданам пожилого возраста, инвалидам, семьям с детьми, другим категориям населения, нуждающимся в социальной поддержке.

Участвует в привлечении различных организаций к решению вопросов оказания социальной помощи пенсионерам, инвалидам, семьям с детьми и отдельным гражданам.

Центр оказывает социальные услуги согласно территориальному перечню.

В структуру центра входят следующие подразделения:

- 1 отделение социального обслуживания на дому;
- отделение дневного пребывания;
- отделение социальной реабилитации инвалидов;

 

