', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'Станция метро Баррикадная, последний вагон из центра, выход к Зоологическому парку. Из стеклянных дверей выйти направо и через 60 метров повернуть налево. Далее вдоль улицы Баррикадная дойдите до Садового кольца, по подземному пешеходному переходу перейдите на другую сторону Садового кольца, из подземного перехода выход направо. Дойти до магазина Bosco и перед ним повернуть налево. Далее вдоль Поварской улицы, мимо театра Киноактера, до первого поворота направо. Повернуть на Трубниковский переулок и далее 150 метров до учреждения. Время в пути займет около 15 минут. Станция метро Смоленская, последний вагон из центра. Из стеклянных дверей налево сквозь арку, далее повернуть направо и, вдоль Новинского бульвара, идти 500 метров до пересечения с улицей Новый Арбат. По подземному пешеходному переходу перейти на другую сторону улицы Новый Арбат и идти 100 метров до Кинотеатра «Октябрь», перед кинотеатром повернуть налево на Трубниковский переулок, далее 300 метров до учреждения. Время в пути займет около 15 минут. Станция метро Арбатская (Арбатско-Покровской линии): первый вагон из центра, из стеклянных дверей налево, далее по подземному пешеходному переходу на другую сторону улицы Новый Арбат. На остановке «Арбатские ворота» троллейбус №2 или №44, далее до остановки «Новинский бульвар», из троллейбуса направо и идти 100 метров до Кинотеатра «Октябрь», перед кинотеатром повернуть налево на Трубниковский переулок, далее 300 метров до учреждения. Время в пути займет около 25 минут. ', '55.7555,37.586859', '45286552', NULL, 0);
