Основные виды деятельности ГБУ ТЦСО «Беговой»:

- Мониторинг социальной и демографической ситуации, уровня социально-экономического благополучия граждан на территории обслуживания.

- Выявление и дифференцированный учет граждан, нуждающихся в социальной поддержке, определение необходимых им форм помощи и периодичности (постоянно, временно, на разовой основе) ее предоставления.

- Обслуживание на дому граждан пожилого возраста и инвалидов, частично утративших способность к самообслуживанию.

- Предоставление адресной неотложной помощи разового характера гражданам, признанным нуждающимися в социальном обслуживании и остро нуждающимся в социальной поддержке.

- Социальное обслуживание граждан пожилого возраста и инвалидов в полустационарной форме (на базе отделения дневного пребывания).

-  Оказание разовых услуг «Мобильной социальной службой».

