 В районе проживает более 75,2 тысяч человек, из которых  более трети пользуются услугами Центра. В настоящее время в Центре работают 8 отделений, в которых трудятся профессионалы своего дела.
Филиал Аэропорт оказывает следующие виды услуг
- социально-бытовые, направленные на поддержание жизнедеятельности граждан в быту;
- социально-медицинские, направленные на поддержание и улучшение здоровья граждан ;
- социально-экономические, направленные на поддержание и улучшение жизненного уровня;
- социально-правовые, направленные на поддержание или изменения правового статуса;
-платные услуги.
Персонал учреждения имеет профессиональную подготовку и соответствует квалификационным требованиям, установленным для данной профессии. Знает и соблюдает действующие законы, иные правовые акты и нормативные документы, касающиеся профессиональной деятельности персонала, а также должностные инструкции, правила внутреннего трудового распорядка, приказы и распоряжения администрации учреждения.
