Сфера деятельности учреждения: адресное обслуживание граждан, нуждающихся в социальной поддержке путем оказания социальной, бытовой, медицинской, психологической, консультативной и иной помощи, а также предоставления социальных услуг.	
Вид приспосабливаемого объекта:  Учреждение социальной защиты		
Характеристика приспособленного объекта филиал «Теплый Стан»: Учреждение находится на 1 этаже многоэтажного жилого дома, площадью 533 кв.м,  имеется входная группа, пути движения для доступа в зону оказания услуг, зона оказания услуг, санитарно-бытовые помещения, средства информации и телекоммуникации, территория учреждения.
