Целями деятельности Учреждения являются:

1. Оказание услуг по адаптации к самостоятельному проживанию воспитанников и выпускников организация для детей-сирот и детей, оставшихся без попечения родителей, а также лиц из числа детей-сирот и детей, оставшихся без попечения родителей, оказавшихся в трудной жизненной ситуации.
2. Адаптация к самостоятельному проживанию воспитанников и выпускников организаций для детей-сирот и детей, оставшихся без попечения родителей, а также лиц из числа детей-сирот и детей, оставшихся без попечения родителей, оказавшихся в трудной жизненной ситуации.

Для достижения указанных целей деятельности Учреждение осуществляет следующий вид деятельности: деятельность по уходу с обеспечением проживания прочая, в том числе

1. Содействие выпускникам в получении образования, трудоустройстве, адаптации в обществе, организации досуга, помощь в реализации и защите их личных, жилищных, имущественных, иных прав и законных интересов.
2. Оказание консультативной, социально-правовой и социально-психологической помощи выпускникам.
3. Поддержка выпускников в решении проблем самообеспечения, реализации возможностей по преодолению сложных жизненных ситуаций.
4.Содействие выпускникам в реализации социальных гарантий.
5.Организация индивидуального процесса сопровождения выпускников при постинтернатной адаптации.
6. Проведение диагностики и коррекции процесса постинтернатной адаптации.
7. Предоставление жилого помещения для временного проживания, осуществление содержания, воспитания и образования детей-сирот и детей, оставшихся без попечения родителей, помещенных в Учреждение под надзор.
8. Профилактика отказов несовершеннолетними матерями, находящимися в Учреждении, от своих новорожденных детей.
9. Комплексная коррекция нарушений в развитии и реабилитация воспитанников с ограниченными возможностями здоровья.
10. Обучение специалистов в области образования, социальной защиты, руководителей и членов общественных организаций в области постинтернатной адаптации молодых людей.
11. Социальная адаптация воспитанников Учреждения.
12. Представительство и защита прав и законных интересов воспитанников, а также осуществление иных прав и обязанностей законного представителя несовершеннолетних воспитанников из числа детей-сирот и детей, оставшихся без попечения родителей.
13. Формирование у воспитанников адекватной современному уровню знаний и уровню ступени обучения целостной картины мира.
14. Проведение профориентационной диагностики, консультирования, содействие профессиональному самоопределению воспитанников.
15. Создание основы для осознанного выбора и освоения воспитанниками профессии.
16. Формирование у воспитанников трудолюбия, уважения к правам и свободам человека, любви к Родине, семье, уважительного отношения к духовному и культурному наследию, навыков здорового образа жизни, культуры поведения, законопослушания.
17. Социальная адаптация и подготовка воспитанников к самостоятельной жизни.
