Директор: Музякова Людмила Платоновна (с 2007 года до слияния являлась директором специализированного дома ребенка №19, после переименования – ГКУ ЦССВ « Маяк»).
ГКУ ЦССВ «Маяк» создан в соответствии с приказом Мосгорздравотдела от 5 июля 1950 №772. Наименование учреждения при создании: Дом ребенка №19 Мосгорздравотдела.
Дом ребенка № 19 с 1950 по 1969 г.г. находился в помещениях отведенных Исполкомов Моссовета, в поселке 42 км. Казанской железной дороги. В 1970 г. учреждение переехало в типовое детсадовское здание по адресу г. Москва, Открытое шоссе дом 29,корпус 12.
На основании приказа №1263 от 09.11.2012 Департамента здравоохранения города Москвы к ГКУЗ «СДР №19 ДЗМ» в ходе реорганизации присоединен ГКУЗ «СДР №24 ДЗМ» (Дом ребенка №24).
Государственное казенное учреждение здравоохранения города Москвы «Специализированный дом ребенка №19 для детей с органическим поражением центральной нервной системы и нарушением психики Департамента здравоохранения города Москвы» в соответствии с распоряжением Правительства Москвы от 10 декабря 2013 г. №704-РП передано в ведомственное подчинение Департамента социальной защиты населения города Москвы.
На основании приказа Департамента труда и социальной защиты населения города Москвы от 5 октября 2015 г. № 967 Государственное казенное учреждение города Москвы Специализированный дом ребенка № 19 для детей с органическим поражением центральной нервной системы и нарушением психики Департамента социальной защиты населения города Москвы переименовано в Государственное казенное учреждение города Москвы Центр содействия семейному воспитанию «Маяк» Департамента труда и социальной защиты населения города Москвы (сокращенное название - ГКУ ЦССВ «Маяк»).
На основании приказа Департамента труда и социальной защиты населения города Москвы от 3 октября 2016 г. № 1077 «О реорганизации Государственного казенного учреждения города Москвы Центра содействия семейному воспитанию «Маяк» Департамента труда и социальной защиты населения города Москвы» реорганизовано ГКУ ЦССВ «Маяк» путем присоединения к нему ГБУ ЦССВ «Благодарение».
В свою очередь, ГБУ ЦССВ «Благодарение имеет свою уникальную историю. Детский дом существует с 1918 года. В 1950-ые детский дом был специализированным дошкольным детским домом № 27 Ленинградского района города Москвы по адресу – ул. Южная, д. 8.
В детском доме воспитывалось 125 мальчиков и девочек в возрасте от 6 до 13 лет. 87 из них были сиротами, 30 – имели одного родителя, 8 детей имели обоих родителей. Из общего числа детей – 61 ребенок являлся ребёнком погибших воинов и партизан Великой Отечественной войны.
Педагогический коллектив дошкольного детского дома возглавляла директор – Глебова Евдокия Васильевна, 1904 г.р., член ВКПб. Педагогический коллектив состоял из 14 воспитателей, даты рождения, которых относятся к 1895 – 1924 годам. За время своей работы педагогический коллектив получил 28 правительственных наград, Евдокия Васильевна, была награждена орденом «Красной звезды».
Дошкольный дом уже располагался в специально построенном в 1939 году здании, включающем в себя 4 спальни для детей, 4 комнаты для занятий и игр, зала, читальни, двух медицинских изоляторов, двух кабинетов и кухни с подсобными помещениями. Под усадьбой детского дома располагался 1 гектар земли, пахотная полевая земля составляла 8 гектаров, пахотная огородная и бахчевая земля – полгектара. Всего дом владел 9,5 гектаров земли. Дом имел дровяной сарай, своё овощехранилище, двое саней, две телеги, одни окучники, два конных плуга.
Библиотека учреждения насчитывала 150 наименований художественной литературы, 75 педагогической и методической, 11 наименований периодической печати и журналов. Детский дом имел киноаппарат узкоплёночной звуковой, немой, эпидиаскоп, динамики. Из музыкальных инструментов у дошкольного детского дома были рояль, патефон, детский аккордеон, 4 детских гармошки и барабан.
Шефами детского дома являлись завод 115, ЦАГИ, Машиностроительный завод, Протезный завод, МАИ.
С 1967 года на основании приказа Московского городского отдела социального обеспечения от 12.10.1967 № 68, специализированный дошкольный детский дом-интернат был перепрофилирован в Детский дом инвалидов № 21 для детей с глубокой умственной отсталостью.
ГКУ ДДИ № 21 и Государственное бюджетное образовательное учреждение города Москвы (коррекционная) школа интернат для детей-сирот и детей, оставшихся без попечения родителей, с ограниченными возможностями здоровья VIII вида № 80, объединены, в соответствии с приказом Департамента социальной защиты населения города Москвы от 23.05.2014 № 523, в Государственное бюджетное учреждение города Москвы Центр содействия семейному воспитанию «Благодарение» Департамента труда и социальной защиты населения города Москвы.
Целями деятельности Учреждения являются содержание, воспитание, защита прав и законных интересов детей-сирот и детей, оставшихся без попечения родителей, а также детей, имеющих родителей (законных представителей) и временно помещенных в Учреждение в соответствии с законодательством Российской Федерации, из числа детей с органическим поражением центральной нервной системы и нарушением психики.
Учреждение осуществляет медицинскую деятельность согласно лицензии Федеральной службы по надзору в сфере здравоохранения и социального развития. На право осуществления образовательной деятельности получена лицензия Департамента образования Правительства г. Москвы.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "f", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "16:30", "monend": "17:45", "satend": "18:00", "sunend": "18:00", "thuend": "17:45", "tueend": "17:45", "wenend": "17:45", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', NULL, NULL, NULL, NULL, 0);

дополнительное профессиональное образование (курсы повышения квалификации) специалистов учреждений, подведомственных Департаменту труда и социальной защиты населения города Москвы, включая прогнозирование и планирование повышения квалификации, оказание организационно-методической помощи;

разработка дополнительных профессиональных образовательных программ;

экспертиза авторских программ и учебно-методических материалов;

проведение научно-исследовательских и прикладных исследований, направленных на получение новых знаний в области реализации семейной и молодежной политики Правительства города Москвы, а также внедрение в практику результатов исследований;

организация обмена опытом по наиболее актуальным вопросам реализации семейной политики Правительства города Москвы путем проведения научно-практических конференций, семинаров, круглых столов, совещаний, мастер-классов и других мероприятий;

подготовка граждан, выразивших желание стать опекунами или попечителями несовершеннолетних граждан либо принять детей, оставшихся без попечения родителей, в семью на воспитание в иных установленных семейным законодательством Российской Федерации формах;

консультирование и оказание социально-правовой, социально-педагогической, социально-психологической помощи специалистам муниципалитетов и учреждений, подведомственных Департаменту труда и социальной защиты населения города Москвы, а также гражданам, выразившим желание стать опекунами или попечителями несовершеннолетних граждан либо принять детей, оставшихся без попечения родителей, в семью на воспитание в иных установленных семейным законодательством Российской Федерации формах по вопросам защиты прав и законных интересов детей-сирот и детей, оставшихся без попечения родителей;

разработка и внедрение методических материалов по вопросам защиты прав и законных интересов детей-сирот и детей, оставшихся без попечения родителей, организации сопровождения замещающей семьи.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "f", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "15:30", "monend": "18:00", "satend": "18:00", "sunend": "18:00", "thuend": "18:00", "tueend": "18:00", "wenend": "18:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', NULL, NULL, NULL, NULL, 0);
Центр осуществляет свою деятельность под руководством Управления социальной защиты населения Восточного административного округа города Москвы, Департамента социальной защиты населения города Москвы во взаимодействии с территориальными органами исполнительной власти, органами местного самоуправления и учреждениями социальной защиты, здравоохранения, образования, внутренних дел, общественными, благотворительными и другими организациями.
Основной задачей Центра является организация социального обслуживания и оказание социальных, оздоровительных, педагогических, профилактических и иных услуг помощи гражданам пожилого возраста, инвалидам, семьям с детьми, другим категориям населения, нуждающимся в социальной поддержке.
Участвует в привлечении различных организаций к решению вопросов оказания социальной помощи пенсионерам, инвалидам, семьям с детьми и отдельным гражданам.
Центр возглавляет директор, назначаемый и освобождаемый от должности начальником Управления социальной защиты населения административного округа по согласованию с Департаментом социальной защиты населения города Москвы.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', '142853, Московская обл., Ступинский р-н, дер. Радужная, Садовая ул., д.3', NULL, NULL, NULL, 0);
