Структура филиала «Солнечный» многогранна, в ее состав входят: 13 Отделений социального обслуживания на дому; Отделение социального патронажа; Отделение дневного пребывания граждан пожилого возраста и инвалидов;   Сектор мобильная социальная служба; Отделение социальной помощи семье и детям; Отделение реабилитации инвалидов; Кабинет выдачи и  проката  технических средств реабилитации. 
Филиал «Солнечный» разрабатывает и реализует политику социального обслуживания населения 8,9,10,11,12 микрорайонов  в Зеленоградском административном округе Москвы, в соответствии с приоритетами социально-экономического развития Российской Федерации.
Специалисты филиала «Солнечный» находятся в поиске новых, максимально адекватных современным условиям моделей и подходов в решении вопросов социального обслуживания. В настоящее время можно выделить несколько приоритетных направлений:
Организация культурно - досуговых мероприятий, способствующих поддержанию активного образа жизни, привлечению к посильной трудовой деятельности, социальной адаптации в обществе пожилых людей и инвалидов (активное участие в работе кружков,   проведение творческих встреч, праздничных мероприятий, мероприятий к  памятным датам).
Осуществление мероприятий реабилитации (комплекс оздоровительно-реабилитационных мероприятий, включающий в себя занятия оздоровительной физкультурой, психологическую помощь, работа «школы здоровья» с лекциями врачей специалистов);
Одной из важнейших задач остается реализация социальной политики государства по отношению к инвалидам, направленной на обеспечение их жизнедеятельности по принципу «равный среди равных». Кабинет ТСР «Солнечного»  обслуживает инвалидов всего округа.
Порой наши жители не всегда могут сориентироваться – куда необходимо обратиться находясь в трудной жизненной ситуации, наша задача подсказать Вам где найти нужную информацию. Мы всегда готовы Вам помочь!    
﻿Доброта – язык, который могут слышать глухие и видеть слепые.​
(С) Марк Твен.
