 Для достижения указанных целей филиал осуществляет следующие основные виды деятельности:
1. Мониторинг социальной и демографической ситуации, уровня социально – экономического благополучия граждан на территории обслуживания.
2. Выявление и дифференцированный учет граждан, нуждающихся в социальной поддержке, определение необходимых им форм помощи и периодичности (постоянно, временно, на разовой основе) её предоставления.
3. Нестационарное обслуживание на дому граждан пожилого возраста и инвалидов, частично утративших способность к самообслуживанию.
4. Нестационарное социальное обслуживание несовершеннолетних и семей с детьми, а также лиц из числа детей-сирот и детей, оставшихся без попечения родителей от 18 до 23 лет, находящихся в трудной жизненной ситуации и (или) социально опасном положении.
5. Нестационарное социально-медицинское обслуживание на дому граждан пожилого возраста и инвалидов, частично утративших способность к самообслуживанию.
6. Социальный патронаж на дому граждан пожилого возраста и инвалидов частично или полностью утративших способность к самообслуживанию.
7. Нестационарное социальное обслуживание несовершеннолетних, граждан пожилого возраста и инвалидов в форме дневного пребывания.
8. Оказане разовых услуг «Мобильной социальной службой».
9. Оказание гражданам социально-экономических, социально-педагогических, социально-правовых, социально-психологических, социально-медицинских, социально-бытовых, социально-консультативных, санитарно-гигиенических, культурно-досуговых, консультативных услуг при условии соблюдения принципов адресности и преемственности помощи.
10. Оказание услуг по обеспечению инвалидов, детей-инвалидов и лиц с ограничениями жизнедеятельности техническими средствами реабилитации.
11. Участие в работе по профилактике безнадзорности  несовершеннолетних, защите их прав.
12. Социальное сопровождение выпускников интернатных учреждений, семей с детьми, находящихся в социально опасном положении.
13. Внедрение в практику новых форм и методов социального обслуживания в зависимости от характера нуждаемости населения в социальной поддержке и с учетом социально – экономического развития города Москвы.
14. Проведение мероприятий по повышению профессионального уровня работников филиала.

