Целями деятельности филиала «Бирюлево» являются: 
- удовлетворение потребностей  инвалидов, детей-инвалидов и лиц с ограниченными возможностями  здоровья в доступном и качественном социальном обслуживании  в виде предоставления комплексных услуг по социальной реабилитации в нестационарной форме, направленной на устранение или компенсацию ограничений жизнедеятельности; 
- содействие в обеспечении максимально полной и своевременной социальной интеграции инвалидов и детей-инвалидов в обществе, семье; к обучению и труду; 
- предоставление услуг по социально-бытовой и социально-средовой адаптации и реабилитации; организации и осуществления мероприятий, направленных на обучение навыкам проведения досуга, отдыха, физической культуры и спорта.
В филиале «Бирюлево» функционируют: 
-  отделение социальной реабилитации инвалидов (ОСРИ);
-  отделение социальной реабилитации детей-инвалидов (ОСРДИ);
-  кабинет выдачи технических средств реабилитации.
Специалистами отделений оказываются услуги по социально-средовой и социально-бытовой адаптации, социально-педагогической, социально-психологической, методами физической культуры и спорта, профессиональной ориентации и профессиональному консультированию, социокультурной реабилитации, а также по обеспечению техническими средствами реабилитации и абсорбирующим бельём.
