          В городе Москве в 1989 году открыт первый центр социального обслуживания - Кировский центр социального обслуживания пенсионеров и инвалидов. Поначалу это было всего несколько отделений: отделение социального обслуживания на дому, отделение срочной социальной помощи и отделение дневного пребывания.
          С 1998 года ГУ ЦСО Отрадное открылись новые отделения: отделение социально-медицинского обслуживания на дому, отделение социальной реабилитации инвалидов, отделение помощи семье и детям и др., то есть расширился контингент обслуживаемых в центре граждан. Малообеспеченные семьи с детьми, дети – выпускники интернатных учреждений, опекунские семьи, инвалиды трудоспособного возраста и др. категории граждан, нуждающиеся в социально-экономической поддержке государства, смогут обратиться в центр за помощью.
          В 2003 году Центр стал Комплексным и на сегодня в нём работают: пункт приёма вещей от населения, пункт стрижки волос, юристы, социологи, психологи, специалисты по социальной работе, ...
          С 01 ноября 2011 года новое название Центра: Государственное бюджетное учреждение центр социального обслуживания Отрадное (ГБУ ЦСО Отрадное).
          С 24 сентября 2012 года новое название Территориальный центр социального обслуживания №9 филиал Отрадное.
          В последнее время прослеживается тенденция привлечения различных благотворительных, общественных, государственных предприятий и организаций к взаимодействию с Центрами социального обслуживания. Благодаря этому достигается цель адресного оказания социально-экономической, материальной, психологической помощи именно тем людям, которые в ней остро нуждаются.
          Совместно с  Управой района, Муниципалитетом, районными общественными организациями (Общество инвалидов, Совет ветеранов и др.), разрабатываются программы, задачами которых является более полный охват услугами Центров наименее защищенных слоёв населения, адресность в оказании помощи и содействии адаптации людей к быстро меняющимся условиям жизни.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "16:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'метро Октябрьское поле далее пешком или автобусом № 39 до остановки Завод Энергоприбор ', NULL, '45283587', NULL, 0);

