         Открытие Центра произошло  в сентябре 1997 года, и  возглавила  его Никифорова Елена Викторовна, которая по сей день является директором учреждения.
      На момент открытия  Центр состоял из: 
- 4 отделений социальной помощи на дому, направленных на максимальное продление естественных условий проживания граждан, частично утративших способность к самообслуживанию,  
- отделения срочного социального обслуживания, оказывающего срочную социальную помощь разового характера гражданам, попавшим в трудную жизненную ситуацию, 
-  отделения дневного пребывания, направленного на организацию питания и отдыха пенсионеров и инвалидов, культурно-досуговую и клубно-кружковую работу.
       Чуть позже, в начале 1998 года было открыто отделение социально-медицинского обслуживания для одиноких граждан, полностью утративших способность к самообслуживанию и страдающих тяжелыми хроническими заболеваниями. Все эти отделения занимали половину здания нынешнего центра.
    Шло время. В Центре решались новые задачи, расширялся контингент обслуживаемых граждан и соответственно спектр предоставляемых услуг, открывались новые отделения.
   В 2004 году Центр был переведен в статус  Государственного учреждения Комплексный центр социального обслуживания, который насчитывал  уже 13 отделений:
- Социального обслуживания на дому (ОСО) – 6 отделений;
- Социально-медицинского обслуживания на дому (ОСМО);
- Срочного социального обслуживания (ОССО);
- Дневного пребывания для пенсионеров (ОДП);
- Приема граждан, обработки информации, анализа и прогнозирования (ОПИАП) – 2004г.;
- Дневного пребывания несовершеннолетних (ОДПН) – 2003г.;
- Профилактики безнадзорности несовершеннолетних (ОПБН) – 2004г.;
- Помощи семье и детям (ОПСиД) – 2000г. 
Отделение приема граждан, обработки информации, анализа и прогнозирования было открыто в целях систематизации работы Центра с учетом потребностей обслуживаемых граждан, проведения аналитической и прогностической работы для улучшения качества обслуживания, а также для осуществления первичного приема.
  Со временем контингент обслуживаемых лиц детских отделений ОДПН и ОПБН увеличивался, не хватало помещений. В связи с этим было принято решение открыть в районе Бутырский Центр помощи семье и детям, в основу которого легли отделения нашего центра ОПСиД, ОПБН, ОДПН. 2007 году организовано новое учреждение для обслуживания многодетных семей, одиноких матерей с детьми и  малообеспеченных семьей ГБУ ЦСПСиД «Родник». Для него было выделено помещение с большей площадью. А в освободившем помещении нашего Центра в 2008 г. было создано отделение социальной реабилитации инвалидов с отличным тренажерным залом.
      С января 2009 г. при отделении социальной реабилитации инвалидов открыт сектор по прокату технических средств реабилитации и выдаче абсорбирующего белья. 
     С целью внедрения новых форм социального обслуживания в июле 2011 года в отделении срочного социального обслуживания открыт сектор «Мобильная социальная служба».
       В связи с развитием в нашей стране рыночных отношений в Центре были сделаны первые шаги в направлении большей самостоятельности учреждения, перехода на самоокупаемость. Так в Центре были введены платные социальные услуги в целях расширения контингента обслуживаемых лиц и спектра предоставляемых услуг. 
    В перспективе развития Центра оказание больше дополнительных платных услуг льготным категориям граждан, укрепление материально-технической базы и, как следствие, разработка новых социально-инновационных методик и программ.
