          В 1995 году присоединилась вторая территория по адресу ул. Дубравная д.40 корп.1 и открылись 2 отделения дневного пребывания. 
          На основании приказа ДСЗН города Москвы № 340/9 от 29.06.2012г. путем слияния четырех Центров социального обслуживания образовано Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания №32 ( сокращенное наименование, ГБУ ТЦСО №32) по адресу 123298, г. Москва , ул. Маршала Бирюзова, д.4, корп.2 ,что позволило существенно сократить государственные ассигнования на содержание управленческого аппарата и направить их на повышение эффективности и качества социальных услуг.
Филиал «Митино» ГБУ ТЦСО "Щукино" является поставщиком социальных услуг, которые предоставляются их получателям в форме социального обслуживания на дому и в полустационарной форме.   На учете в ГБУ ТЦСО Щукино филиал «Митино» состоит 16622 человека. 
         По разным направлениям деятельности в филиале работают 12 подразделений:
•Отделения социального обслуживания (9)
•Отделение реабилитации инвалидов
•Отделение дневного пребывания
•Отделение срочного социального обслуживания

        По адресу: ул. Дубравная, д. 40, корп.1 работают:
•	Отделения социального обслуживания на дому (9 отделений) предоставляют получателям социальных услуг социально-бытовые, социально-медицинские, социально-психологические, социально-правовые, социально-экономические услуги. Обслуживание на дому осуществляется путем предоставления гражданам социально-бытовых, социально-медицинских, социально-психологических, социально-правовых и иных услуг. Предоставление социального обслуживания гражданам осуществляется бесплатно, за частичную и полную плату.
