•	Отделение дневного пребывания граждан пожилого возраста и инвалидов предназначено для культурно-досугового обслуживания неработающих граждан пожилого возраста и инвалидов, сохранивших способность к самообслуживанию и активному передвижению, организации их питания, отдыха и досуга. При посещении отделения Вам будут предложены горячие обеды, занятия оздоровительной гимнастикой, экскурсии, лекции, концерты. Для преодоления дефицита общения, решения проблем одиночества в филиале функционируют 12 кружков и 9 клубов по интересам. Участие в совместной творческой или другой деятельности облегчает установление дружеских контактов, повышает жизненный тонус. 
Члены творческих коллективов принимают активное участие в выставках фестивалях и конкурсах на районных, окружных и городских площадках. 
В целях укрепления и сохранения здоровья, повышения двигательной активности наших клиентов, медицинской сестрой отделения дневного пребывания проводятся беседы, оздоровительная гимнастика, ионотерапия, аутогенная тренировка, пальчиковая гимнастика и занятия скандинавской ходьбой.
Отделение благотворно сотрудничает с музеями, выставочными залами и многими театрами Москвы, организуя разноплановые экскурсии. 
