На отделение возложены функции по обеспечению инвалидов техническими средствами реабилитации, в т.ч. абсорбирующим бельем, работает пункт проката технических средств реабилитации. 
Филиал «Митино» совместно с управой района, общественными организациями участвует в реализации государственной программы «Доступная среда» на 2011-2015 гг. среды. Сотрудники филиала выявляют нуждаемость инвалидов в адаптации среды и способствуют ее удовлетворению. В отделении функционируют: «Школа здоровья», компьютерный класс и «Интернет-клуб», молодежная площадка «Мир открыт для всех», проводится культурно-досуговая работа, работают творчесткие кружки творческие кружки: «Батик», «Флористика», «Декупаж», «Пластик», «Живопись», «Пэчворк», «Вязание. Волшебная нить». 
В отделении успешно решается проблема социально-психологической адаптации и интеграции в обществе молодых людей с ограниченными возможностями путем реализации социокультурной, социально-психологической, социально-медицинской и социально-профессиональной реабилитации, проведения физкультурно-оздоровительных мероприятий. 
Тел. 8(495)751-00-97.
