1. Отделения социального обслуживания на дому (ОСО) и специализированные отделения социально-медицинского обслуживания на дому (ОСМО).
Функционируют во всех центрах социального обслуживания, предназначенные для временного (до 6 месяцев) или постоянного оказания гражданам пожилого возраста и инвалидам, частично утратившим способность к самообслуживанию, социально-бытовых услуг (осуществляется социальными работниками) и доврачебной помощи (осуществляется медицинскими сестрами) на дому.
Порядок принятия, документы:
В трехдневный срок с момента получения письменного заявления гражданина на зачисление руководство центра организует:
- комиссионное обследование материально-бытовых условий проживания заявителя по месту его жительства, по результатам которого составляется соответствующий акт;
- запрашивает выписку из финансово-лицевого счета из жилищно-эксплуатационного учреждения по месту жительства;
- запрашивает заключение о состоянии здоровья и об отсутствии медицинских противопоказаний к социальному обслуживанию на дому из лечебно-профилактического учреждения здравоохранения.
При отсутствии письменного согласия заявителя на оформление вышеуказанных документов центром социального обслуживания, документы граждане представляют самостоятельно.
Документы могут быть представлены в подлинниках или копиях, заверенных в установленном порядке.
На основании указанных документов Комиссия центра социального обслуживания в недельный срок принимает решение о зачислении гражданина на постоянное или временное социальное обслуживание на дому или выносит мотивированное решение об отказе в социальном обслуживании на дому, о чем руководителем Центра сообщается заявителю.
В случае принятия гражданина на надомное обслуживание в соответствии с действующим законодательством с ним заключается Договор на оказание услуг нестационарного социального обслуживания.
2. При отделениях срочного социального обслуживания функционирует сектор «Мобильная социальная служба» - создан для оказания разовых услуг социального обслуживания, в том числе дополнительных услуг, не входящих в Территориальный перечень гарантированных государством социальных услуг, предоставляемых населению учреждениями социального обслуживания города Москвы, услуги ориентированы на индивидуальные потребности гражданина:
- инвалиды и лица с ограничениями жизнедеятельности;
- лица, достигшие пенсионного возраста, но не нуждающиеся в надомном социальном обслуживании на постоянной основе;
- лица, не достигшие пенсионного возраста, нуждающиеся в социальной помощи, но не имеющие право на надомное обслуживание (или не нуждающиеся в таком обслуживании на постоянной основе);
- семьи, имеющие детей-инвалидов;
- одинокие матери, разведенные женщины и мужчины, вдовы и вдовцы, воспитывающие детей, в т.ч. детей-инвалидов;
- многодетные семьи.
Пример разовых услуг: содействие в оформлении ИПР, доставка технических средств реабилитации, оказание на дому услуг по уходу за детьми-инвалидами, сопровождение детей-инвалидов в учреждения дополнительного образования и др.
Периодичность оказания разовых услуг определяется в зависимости от индивидуальной потребности граждан, продолжительность (не более 4 часов в день с учетом проезда сотрудника к месту оказания услуги и обратно) и перечень услуг устанавливается центром социального обслуживания по предварительной заявке и личному заявлению обратившегося.
3. Отделения дневного пребывания – функционируют в каждом центре социального обслуживания, предназначаются для организации горячего питания, социально-бытового, культурного обслуживания граждан пожилого возраста и инвалидов, сохранивших способность к самообслуживанию и активному передвижению, находящихся в трудной жизненной ситуации.
