<p>1.Отделение социального обслуживания на дому (ОСО)находится&nbsp;по адресу ул. Одесская д.9 корп.1 и создано для оказания одиноким и одинокопроживающим гражданам, частично утратившим способность к самообслуживанию и нуждающимся в посторонней поддержке, социально-бытовой помощи в надомных условиях. Предлагаются следующие услуги: - покупка и доставка на дом продуктов питания и промышленных товаров; - содействие в оплате коммунальных услуг; - оформление различных льгот, в том числе жилищной субсидии; - сдача вещей в химчистку, ремонт обуви; - содействие в получении рецептов в поликлинике и обеспечении лекарственными средствами; - консультации психолога.</p>

<p>2. Отделение срочного социального обслуживания (ОССО) расположено по адресу Севастопольский проспект, д.51, предназначено для оказания остронуждающимся гражданам помощи разового характера, направленной на поддержание их жизнедеятельности. За получением социальных услуг через ОССО может обратиться любой житель нашего района, попавший в трудную жизненную ситуацию. Мы предлагаем следующую помощь: - обеспечение горячим питанием или продуктовыми наборами; - обеспечение одеждой, обувью; - оказание психологической помощи; - оказание одиноким и одинокопроживающим гражданам, частично утратившим способность к самообслуживанию и нуждающимся в посторонней поддержке, социально-бытовой помощи в надомных условиях, не состоящих на надомном обслуживании.</p>

<p>3.Отделение дневного пребывания (Одесская, д.9 корп 1)&nbsp;предназначено для социально-бытового, культурного и медицинского обслуживания пенсионеров, организации их питания и отдыха, а также поддержания активного образа жизни. Отделение дневного пребывания приглашает социальных клиентов два раза в год на 22 дня. Для клиентов организуются автобусные и пешеходные экскурсии, праздничные обеды к различным юбилейным датам, выставки и вечера художественной самодеятельности. Ежедневно ОДП посещают 30 человек, которые получают горячее питание, а также медицинскую помощь: - оздоровительная физкультура; - фиточай; - кислородный коктейль; - лекции на медицинские темы. К услугам клиентов имеется большая библиотека, а также работают клубы и кружки по интересам,&nbsp;кружок компьютерной грамотности.&nbsp;</p>

<p>4. На базе учреждения осуществляется выдача технических средств реабилитации (ТСР), в том числе абсорбирующего белья при наличии индивидуальной программы реабилитации. Пункт выдачи ТСР расположен по адресу: Севастопольский проспект д. 51&nbsp;телефоны: 8-499-789-44-16</p>
