При застройке района в сталинские времена предполагалось, что этот участок Москвы будет спортивным оазисом, из-за находящегося здесь первого советского стадиона — «Динамо». Неподалёку от него расположена жемчужина района — Петровский дворец, возведённый для отдыха императорской семьи перед въездом в Москву по Тверской дороге. Красота ансамбля и разбитого вокруг него парка издавна привлекала москвичей, устраивавших здесь народные гулянья.');

Мещанский район привлекателен не только своей исторической аурой, но и редкой для центра Москвы свежестью. Зелёные зоны занимают до 20% общей площади района, благодаря заложенному ещё при Петре I Аптекарскому огороду — ныне Ботаническому саду, а так же располагающимся неподалёку Екатерининскому саду, Фестивальному парку и утопающим в зелени Сретенскому, Цветному и Рождественскому бульварам.');

Уровень развития инфраструктуры Тверского района соответствует статусу главного района Москвы. Здесь особенно сильно наблюдается явление, так называемой «суточной миграции», когда дневное «население» района в 7—8 раз превышает постоянное. Поблизости от Тверской улицы с трудом можно найти тихие переулки — сказывается высокая концентрация офисов. Повсюду люди, спешащие на работу или учёбу, а также туристы приехавшие осмотреть местные достопримечательности. Поэтому инфраструктура района, призвана удовлетворять потребности и желания не только жителей, но и гостей района. Цены на продукты питания здесь значительно выше, чем в других районах Москвы.

Большие трудности Тверской район испытывает с парковочными местами, в часы пик нередки заторы и пробки.');

Хамовники — один из наиболее благоприятных с точки зрения экологии районов столичного центра. Здесь насчитывается сразу нескольких зелёных зон вроде Нескучного сада или парка имени Мандельштама.

Социальная инфраструктура района развита очень хорошо. С точки зрения комфорта проживания Хамовники можно считать одним из лучших районов центра Москвы.

Жилой фонд Хамовников, практически полностью сформированный в советское время, и сегодня находится в хорошем состоянии. Украшением района служит Фрунзенская набережная, где расположены прекрасные образцы «сталинской» застройки — как жилые, так и административные дома. Вдоль неё расположились многочисленные военные учреждения, поэтому в советские времена квартиры в домах здесь получали работники государственного аппарата, сотрудники КГБ и высший командный состав Вооружённых сил. Кроме того, некоторый процент квартир доставался видным деятелям науки и искусства. Сейчас качественное жилищное строительство в Хамовниках ведётся в основном в центре района. Новых зданий вдоль Фрунзенской набережной практически нет.');

Главная особенность Красносельского района — плотная транспортная развязка. Особенно это касается железнодорожного транспорта, и речь идёт не только о пассажиропотоке. Близость к железнодорожному узлу спровоцировала появление в районе крупных промышленных предприятий — кондитерских, ткацких фабрик, молочного завода, пекарен и т.п. История каждого предприятия по-своему интересна и неразрывно связана с жизнью и историей становления самого района.

Визитной карточкой Красносельского района, безусловно, является Комсомольская площадь (в народе называемая площадью трёх вокзалов) — крупнейший железнодорожный узел столицы. Здесь расположены два вокзала Московской железной дороги (Ярославский и Казанский) и один — Октябрьской железной дороги (Ленинградский).');

Особенность современного Арбата заключается в том, что на его территории не ведётся массовое жилищное строительство и невелика концентрация промышленных предприятий, а из строительных работ проводятся только реконструкционные.

Арбат является районом с неоднородной застройкой. В основном это особняки и другие постройки, возведённые ещё до революции в XVIII—XIX вв. Часть таких домов реконструирована. Как правило, их обустраивают под бизнес центры или под жильё элитного класса.

Особенным шармом района являются его тихие переулки. На улицах Арбата располагаются посольства иностранных государств, небольшие офисные центры, рестораны и кафе. На главных улицах всё иначе — здесь расположено большое количество дорогих ресторанов, пестрят своими вывесками бутики известных марок.');

Основной жилищный фонд Пресненского района построен в первой половине XX века. В районе расположены объекты федерального и общегородского значения: Дом Правительства Российской Федерации, Дом кино, ИТАР-ТАСС, выставочный комплекс «Экспоцентр», и гордость района — крупнейший в стране Московский зоопарк.');

Невзирая на принадлежность к престижному Центральному округу, Таганка по-прежнему остаётся индустриальным районом. Однако, уже сейчас с территории активно выводят промышленные объекты, подготавливая участки под жилое и коммерческое строительство.

Среди достоинств Таганского района — очень интересная история и, как следствие, — множество памятников архитектуры, а также большое количество старых домов, на месте которых, вероятно, вскоре возведут новые жилые комплексы.');

Архитектурный облик Якиманки разнороден. В пределах Садового кольца сохранилась планировочная структура исторического градостроения, а также большое количество дореволюционных зданий. За Садовым кольцом преобладают кирпичные дома 1925—1978 гг. Довольно много панельных и кирпичных построек появилось после 80-х годов прошлого столетия.

Сегодня район Якиманка динамично развивается, обновляется, строится, при этом здесь сохранилось немало памятников архитектуры прежних эпох: древние прекрасные храмы, особняки, купеческие и дворянские усадьбы, парки, образцы промышленного дизайна. Традиции старины, сохранившиеся в планировке и архитектурных особенностях района, отлично сочетаются с культурной средой. Здесь расположены выставочные залы и музеи, вузы, посольства, больницы, библиотеки. Органичное соединение прошлого и современности определяет неповторимый и прекрасный облик района.');

На территории района сохранилось немало памятников архитектуры и просто ценных зданий исторической застройки, однако большинство из них требует немедленной реставрации из-за своего естественного износа.

Промышленные предприятия Басманного района тесно срослись с селитебной* территорией, и часть из них, к сожалению, не имеет требуемых санитарно-защищённых зон.

На территории района протекает река Яуза и её притоки — Ольховка, Чечера и Черногрязка.');

Нынешний облик Замоскворечье во многом унаследовало с купеческих времён: малоэтажная застройка, созвездие церквей разных стилей — всё это сохранило старую перспективу вида на Кремль. Хотя советское градостроительство не особенно пощадило эти заповедные места.

Садовое кольцо разделяет район на две достаточно сильно различающиеся между собой части. В пределах Садового кольца находится исторически сложившаяся часть города, богатая архитектурными и мемориальными местами, что обуславливает особый подход к реконструкции существующих зданий и новому строительству и т.д.

Территория за Садовым кольцом, вошедшая в состав Москвы в XVIII веке, окончательно сформировалась лишь к 90-м годам прошлого столетия. В этой части района сосредоточено большое число промышленных предприятий и проектных институтов.');


