INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (90, NULL, NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Щукино»', 'ГБУ ТЦСО «Щукино»', NULL, NULL, 'tsco-schukino@mos.ru', 'http://www.tcso32.ru/', 'Центр социального обслуживания был открыт 20.01.1993 г. Одним из основных направлений работы центра является предоставление необходимых социальных и доврачебных услуг одиноким и одиноко проживающим пожилым гражданам и инвалидам. Социальное обслуживание населения в дневное время путем оказания клиентам социально- бытовых, социально-медицинских , культурно-досуговых и консультативных услуг. Предоставляется социальное сопровождение семьям с детьми, находящимся в трудной жизненной ситуации, воспитанникам детских государственных учреждений для детей- сирот. А также ряд платных социальных услуг.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "18:45:00", "monend": "20:00:00", "satend": "17:00:00", "sunend": "18:00:00", "thuend": "20:00:00", "tueend": "20:00:00", "wenend": "20:00:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "09:00:00", "sunstart": "09:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', NULL, NULL, NULL, NULL, 0);
