INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (40, NULL, NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Новогиреево»', 'ГБУ ТЦСО «Новогиреево»', NULL, 'Москва, Канатчиковский, 7', 'tsco-novogireyevo@mos.ru', 'http://tcso-novogireevo.ru', 'Территориальный центр социального обслуживания «Новогиреево» был создан 28 сентября 2012 года на базе центра социального обслуживания района Новогиреево (ЦСО «Новогиреево») с филиалами в районах Перово (бывший ЦСО «Перовский») и Ивановское (бывший ЦСО «Ивановский»). Таким образом, зоной обслуживания ТЦСО «Новогиреево» являются все три этих района. Деятельность ТЦСО «Новогиреево» связана с оказанием широкого спектра социальных услуг гражданам пожилого возраста, пенсионерам, инвалидам, семьям с детьми и людям, попавшим в трудную жизненную ситуацию, при этом основными приоритетами деятельности ТЦСО «Новогиреево» являются поддержание активного образа жизни граждан, вовлечение их в современную социо-культурную сферу, а так же интеграция граждан пенсионного возраста в современное общество. Кроме того, наш Центр участвует в реализации различных общегородских программ, активно сотрудничает с множеством обществ, объединений и организаций города Москвы.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', NULL, '55.701785,37.592527', '81209825004', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (140, NULL, NULL, 'Государственное бюджетное учреждение города Москвы "Комплексный реабилитационно-образовательный центр"', 'ГБУ "КРОЦ"', NULL, 'Москва, Открытое ш., 29к12', 'Shkola-internat44@yandex.ru', 'http://spsch44.mskzapad.ru/', 'ГБУ КРОЦ (ранее ГБУ СКОШИ № 44, приказ ДСЗН г. Москвы от 18.06.2013 №415)  является государственным образовательным учреждением для детей с нарушениями опорно-двигательного аппарата.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (245, NULL, NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Марьино»', 'ГБУ ТЦСО «Марьино»', NULL, 'Москва, Щёлковское, 24', 'tsco-marino@mos.ru', 'http://www.тцсо-марьино.рф/', 'БУ ТЦСО "Марьино" в своей деятельности объединяет полный спектр социального обслуживания населения районов: Марьино, Люблино, Капотня. На базе ГБУ ЦСО "Марьино" в настоящее время реализуется комплекс мер, который позволит в 2013 году воплотить идею создания «Центра активного долголетия».
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (83, NULL, NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Проспект Вернадского»', 'ГБУ ТЦСО «Проспект Вернадского»', NULL, 'Москва, Ленинградский проспект, 23', 'csovernad@dszn.ru', 'http://csovernad.ru/', 'ГБУ ТЦСО "Проспект Вернадского" является поставщиком социальных услуг, и осуществляет свою деятельность в соответствии с Федеральным законом № 442-ФЗ от 28 декабря 2013 г. "Об основах социального обслуживания граждан в Российской Федерации", постановлением Правительства Москвы от 26 декабря 2014 г. № 829-ПП "О социальном обслуживании граждан в городе Москве", другими федеральными законами и иными нормативными правовыми актами субъекта Российской Федерации.
