INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (203, NULL, NULL, 'Государственное бюджетное учреждение Центр социальной помощи семье и детям «Берегиня»', 'ГБУ ЦСПСиД «Берегиня»', NULL, 'Москва, Коломенская, 5', 'bereginya@dszn.ru', NULL, 'Основными направлениями деятельности   Центра является реализация городских и окружных программ, направленных на  оказание комплексной помощи семьям и детям,  попавшим в трудную жизненную ситуацию, профилактику социального сиротства и семейного неблагополучия, социальное сопровождение, реабилитацию и адаптацию семей, детей и подростков,  а также детей-сирот – выпускников интернатных учреждений,  реализацию их законных  прав и интересов, содействие в улучшении социально-психологического и материального  статуса, а также  на укрепление института семьи и формирование здорового образа жизни.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "18:45:00", "monend": "20:00:00", "satend": "17:00:00", "sunend": "00:00:00", "thuend": "20:00:00", "tueend": "20:00:00", "wenend": "20:00:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "10:00:00", "sunstart": "00:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', 'метро Коломенская,первый вагон из центра , выход к к/тОрбита:далее автобусы № 670,724,751,156 до конечной остановки Нагатинский затон. ', '55.683483,37.704502', '45296571', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (53, NULL, NULL, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Южнопортовый»', 'ГБУ ТЦСО «Южнопортовый»', NULL, 'Москва, Каховка, 8', 'tsco-yuzhnoport@mos.ru', 'http://тцсо-южнопортовый.рф/', 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания "Южнопортовый", сокращенное наименование ГБУ ТЦСО "Южнопортовый", предназначено для адресного нестационарного социального обслуживания граждан и семей с детьми, находящихся в трудной жизненной ситуации.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (138, NULL, NULL, 'Государственное бюджетное учреждение города Москвы Центр содействия семейному воспитанию «Берег надежды»', 'ГБУ ЦССВ «Берег надежды»', NULL, 'Москва, Шипиловский, 3', 'beregnmos@dszn.ru', 'http://detdom2.ru/', 'Детский дом был организован в подмосковном городе Пушкино в 1933 году, в 1989 году переведен в Москву. При детском доме с 1992 года работает начальная школа. В сентябре 2008 года на базе Д/дома 2 открыта группа для детей-сирот и детей, оставшихся без попечения родителей, с нарушениями в развитии вследствие ДЦП. 
