INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (238, NULL, NULL, 'Государственное бюджетное учреждение Пансионат для ветеранов труда №31', 'ГБУ ПВТ №31', NULL, 'Москва, Шипиловская, 48', 'pvt31@dszn.ru', 'http://www.pvt31.ru/', 'Ввод в эксплуатацию: 1977 год. Профиль учреждения: пансионат общего типа. Плановая мощность: 564 места, из них 510 мест в бюджетном корпусе, 54 места в отделении повышенной комфортности с платными услугами. На территории располагаются основной 8-ми этажный корпус с пристройкой пищеблока и кинозала, 4-х этажный реабилитационный физкультурно-оздоровительный комплекс, 4-х этажный корпус отделения с комфортными условиями проживания, тёплый гараж. Общее количество комнат основного корпуса: - 319, в том числе одноместных – 121 комната, двухместных – 187 комнат, семейных двухместных – 8 комнат, 3 комнаты приёмно-карантинного отделения. 
