INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (196, NULL, NULL, 'Государственное бюджетное учреждение Центр социальной помощи семье и детям «Родник»', 'ГБУ ЦСПСиД «Родник»', NULL, 'Москва, Рязанский, 64к2', 'cspsid_Rodnik@mail.ru', 'http://www.cspsidrodnik.ru/', NULL, NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "18:00:00", "monend": "18:00:00", "satend": "17:00:00", "sunend": "00:00:00", "thuend": "18:00:00", "tueend": "18:00:00", "wenend": "18:00:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "09:00:00", "sunstart": "00:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', 'ак добраться: До ГБУ ТЦСО «Жулебино» Филиал «Выхино» Из центра в последний вагон до станции "Рязанский проспект", выход в город: 1-Новокузьминская, по экскаватору вверх на улицу. Пройти вперед 80 метров повернуть на право, идти вдоль Рязанского проспекта. Перейти пешеходный переход (справа будет Банк Москвы), идти вдоль 60 и 62 дома, повернуть направо пройти 50 метров до входа в Филиал «Выхино». До отделения дневного пребывания детей и подростков ГБУ ТЦСО «Жулебино» Филиал «Выхино» Метро «Рязанский проспект». Из центра последний вагон, из стеклянных дверей направо, в сторону улицы Вострухина, пешком прямо, мимо поликлиники № 23 до светофора. Перейти дорогу и идти прямо 300 метров. Прямо стоит жилой дом, где с торца находится дверь с пандусом отделения дневного пребывания детей и подростков филиала «Выхино» ГБУ ТЦСО «Жулебино». ', '55.713785,37.803649', '45290554', NULL, 0);
