INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (12, NULL, 11, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Бескудниково» Филиал «Дмитровский»', 'ГБУ ТЦСО «Бескудниково» Филиал «Дмитровский»', NULL, 'Москва, Средняя Первомайская, 46', 'cso-dmitr@mail.ru', NULL, 'Филиал «Дмитровский» был открыт 7 августа 1991 года Решением исполнительного комитета Тимирязевского районного Совета народных депутатов. Основной задачей филиала является организация социальных услуг гражданам пожилого возраста, инвалидам и другим категориям населения Дмитровского района, нуждающимся в социальной поддержке.
