INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (84, NULL, 83, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Проспект Вернадского» Филиал «Тропарево-Никулино»', 'ГБУ ТЦСО «Проспект Вернадского» Филиал «Тропарево-Никулино»', NULL, 'Москва, Одесская, 9к1', 'troparevo-cso@dszn.ru', NULL, 'Филиал "Тропарёво-Никулино" ГБУ ТЦСО "Проспект Вернадского" является поставщиком социальных услуг, и осуществляет свою деятельность в соответствии с Федеральным законом № 442-ФЗ от 28 декабря 2013г. "Об основах социального обслуживания граждан в Российской Федерации", постановлением правительства Москвы от 26 декабря 2014г. № 829-ПП "О социальном обслуживании граждан в городе Москве", другими федеральными законами и иными нормативными правовыми актами субъекта Российской Федерации. Предоставляет получателям социальных услуг социальные услуги на дому и в полустационарной форме социального обслуживания в соответствии со стандартами социальных услуг, утвержденными Департаментом социальной защиты населения города Москвы, индивидуальными программами и условиями договоров, на основании требований действующих нормативных правовых актов, как бесплатно, так и на платной основе в зависимости от среднедушевого дохода получателя социальных услуг.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'метро Нахимовский проспект, из центра 1 выгон, выход к улице Сивашская, выйдя из стеклянных дверей метро, повернуть направо, подняться по ступенькам, дальше пройти вперед до светофора, перейти дорогу по пешеходному переходу, пройти вниз по Сивашской улице ( вдоль пятиэтажек) между 17 и 21 домом пройти вглубь двора. пред Вами зеленый забор , за ним ТЦСО "Зюзино" Г. Москва, ул. Одесская, дом 9, кор .1', '55.661166,37.598438', '45293562', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (31, NULL, 29, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Бибирево» Филиал «Лианозово»', 'ГБУ ТЦСО «Бибирево» Филиал «Лианозово»', NULL, 'Москва, Басманный 1-й, 10', 'tcso-10_lianozovo@mail.ru', 'https://tcso-bibirevo.ru/', '<p>Государственное бюджетное учреждение, территориальный центр социального обслуживания &laquo;Бибирево&raquo; филиал &laquo;Лианозово&raquo; был создан 15 декабря 1996 года. Основным направлением деятельности Центра является оказание адресной социальной помощи гражданам, находящимся в трудной жизненной ситуации и остро нуждающимся в социальной поддержке.В Центре работают четыре отделения : ОТДЕЛЕНИЕ СОЦИАЛЬНОГО ОБСЛУЖИВАНИЯ НА ДОМУ (ОСО),ОТДЕЛЕНИЕ ДНЕВНОГО ПРЕБЫВАНИЯ,ОТДЕЛЕНИЕ СРОЧНОГО СОЦИАЛЬНОГО ОБСЛУЖИВАНИЯ,СЕКТОР &laquo;МОБИЛЬНАЯ СОЦИАЛЬНАЯ СЛУЖБА&raquo;.</p>
