INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (20, NULL, 225, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Беговой» Филиал «Аэропорт»', 'ГБУ ТЦСО «Беговой» Филиал «Аэропорт»', NULL, 'Москва, Весёлая, 11', 'cso-aeroport@yandex.ru', 'http://tcso-begovoy.ru/', 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания "Беговой" филиал "Аэропорт» осуществляет свою деятельность с декабря 1993 года.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (5, NULL, 4, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Таганский» Филиал «Хамовники»', 'ГБУ ТЦСО «Таганский» Филиал «Хамовники»', NULL, 'Москва, Тимирязевская, 10/12', 'tcso-hamovniki@social.mos.ru', 'http://tcsotaganskiy.ru/', '<p>Филиал &laquo;Хамовники&raquo; был создан в 1992 году и с тех пор стал надежным помощником для социально незащищенных жителей района в решении их проблем. Сегодня филиал &laquo;Хамовники&raquo; - многофункциональное социальное учреждение, входящее в состав системы социальной защиты населения города Москвы. Основной задачей филиала является проведение социальных, оздоровительных, педагогических, профилактических и иных мероприятий, направленных на социальную поддержку и обслуживание граждан пожилого возраста, инвалидов, и других категорий граждан.</p>', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "18:45:00", "monend": "20:00:00", "satend": "17:00:00", "sunend": "18:00:00", "thuend": "20:00:00", "tueend": "20:00:00", "wenend": "20:00:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "09:00:00", "sunstart": "09:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', 'От метро Дмитровская трамвай 27 до остановки "Улица Вишневского" ', '55.81211,37.568138', '45277592', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (62, NULL, 60, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Орехово» Филиал «Братеево»', 'ГБУ ТЦСО «Орехово» Филиал «Братеево»', NULL, 'Москва, Магистральный переулок, 7к2', 'Fil_Brateevo@dszn.ru', 'http://tcso-orehovo.ru/', '<p>Наш Центр оказывает социальную помощь лицам пожилого возраста, инвалидам, людям с ограниченными возможностями, многодетным семьям и одиноким матерям, людям, потерявшим кормильца, сиротам. Кроме социальной помощи в виде продуктовых наборов и вещевой помощи в здании Центра оказывается психологическая помощь, консультации по юридическим вопросам, обслуживание на дому, социальное такси, услуги оказываемые на платной и бесплатной основе.</p>
