INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (82, NULL, 80, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Можайский» Филиал «Крылатское»', 'ГБУ ТЦСО «Можайский» Филиал «Крылатское»', NULL, '129626, г. Москва, 3-я Мытищинская ул., 5', 'csomojai@mail.ru', 'http://m-zao.ru', 'Обеспечивает предоставление социальной помощи и предоставление услуг, а также организует работу отделений дневного пребывания граждан пожилого возраста, инвалидов и несовершеннолетних детей, срочного социального обслуживания, отделений социального обслуживания на дому граждан пожилого возраста и инвалидов, социальной реабилитации детей-инвалидов, профилактики безнадзорности несовершеннолетних.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:0000", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:0000", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'Школа находится в пешей доступности от станции метро "Алексеевская". ', '55.807107,37.644459', '45268569000', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (10, NULL, 8, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Мещанский» Филиал «Красносельский»', 'ГБУ ТЦСО «Мещанский» Филиал «Красносельский»', NULL, 'Москва, Палехская, 14', 'tcso-f-krasnoe@dszn.ru', 'http://tcsomeshanskiy.ru/', '<p>В Красносельском районе Государственное учреждение социального обслуживания было создано на основании распоряжения префекта Центрального административного округа от 24.08.2001 г. № 2487-Р. Центр начал свою работу с населением 07.12.2001 г по адресу: Малый Краснопрудный тупик дом 1, строение 1. С 04.08.2011 года был переименован в Государственное Бюджетное учреждение Центр социального обслуживания Красносельский. С 25.09. 2012 года в связи с проведенной реорганизацией, путем слияния Государственных бюджетных учреждений Центров социального обслуживания Басманный, Красносельский и Мещанский Центр Красносельский стал одним из филиалов ГБУ ТЦСО № 2. С 13.06.2013г. в соответствии с Приказом Департамента социальной защиты населения г.Москвы и свидетельства о Государственной регистрации серии 77 № 015225869 учреждение переименовано в ГБУ ТЦСО &quot;Мещанский&quot; филиал Красносельский. Основной задачей Центра является проведение социальных, оздоровительных, педагогических, профилактических и иных мероприятий, направленных на социальную поддержку и обслуживание населения Красносельского района. При этом основной целью является смягчение последствий бедности, снижение социального неравенства, предоставление социальных услуг на основе принципа адресности, повышение качества предоставляемых услуг. В настоящее время в филиале Красносельский работают: - отделение первичного приема граждан; - отделение срочного социального обслуживания; - отделение социально-медицинского обслуживания на дому; - отделение социальной реабилитации инвалидов; - отделение дневного пребывания; - отделение социальной помощи семье и детям; - отделение социального обслуживания на дому ( 6 отделений )</p>', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'Метро ВДНХ , авт. №№172, 244,136, 903, тр. №76 до остановки Ул. Федоскинская, маршрутки №№76, 675. Метро Ботанический сад, авт. 789 до остановки Ул. Федоскинская ', '55.867859,37.700146', '45280597', NULL, 0);
