INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (87, NULL, NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Фили-Давыдково»', 'ГБУ ТЦСО «Фили-Давыдково»', NULL, NULL, 'tsco-fili-davydkovo@mos.ru', 'http://www.fd-zao.ru', 'Деятельность ГБУ ТЦСО «Фили-Давыдково» связана с оказанием широкого спектра социальных услуг гражданам пожилого возраста, пенсионерам, инвалидам и людям, попавшим в трудную жизненную ситуацию, при этом основными приоритетами деятельности ТЦСО являются поддержание активного образа жизни граждан, вовлечение их в современную социо-культурную сферу, а так же интеграция граждан пенсионного возраста в современное общество. Кроме того, наш Центр участвует в реализации различных общегородских программ, активно сотрудничает с множеством обществ, объединений и организаций города Москвы.
