INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (97, NULL, 101, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Зеленоградский» Филиал «Солнечный»', 'ГБУ ТЦСО «Зеленоградский» Филиал «Солнечный»', NULL, NULL, 'cso-sol@yandex.ru', 'http://csosol.wix.com/cso-sol', 'Центр создан и функционирует с 1994 года, обслуживая жителей 8,9, 10,11,12 микрорайонов г.Зеленограда. В составе учреждения функционирует 18 отделений, численность сотрудников составляет 326 человек.
