INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (232, NULL, NULL, 'Государственное  бюджетное учреждение  Научно-практический центр медико-социальной реабилитации инвалидов имени Л.И.Швецовой', 'ГБУ НПЦ МСР имени Л.И.Швецовой', NULL, NULL, NULL, NULL, 'Наш Центр состоит из четырех корпусов общей площадью более 13,5 тыс.кв.м. и расположен в природном комплексе на территории около 2,0 га. Центр является уникальным межотраслевым городским проектом Года равных возможностей. Его организация осуществлялась на основе консолидации усилий органов исполнительной власти города Москвы (Департаменты: здравоохранения, образования, социальной защиты населения, культуры, физической культуры и спорта, труда и занятости, Комитет общественных связей), социально ответственного бизнеса, общественных и благотворительных организаций, частных лиц.', NULL, NULL, NULL, '{"fri": "f", "mon": "f", "sat": "f", "sun": "f", "thu": "f", "tue": "f", "wen": "f", "friend": "18:0000", "monend": "18:0000", "satend": "18:0000", "sunend": "18:0000", "thuend": "18:0000", "tueend": "18:0000", "wenend": "18:0000", "fristart": "09:0000", "monstart": "09:0000", "satstart": "09:0000", "sunstart": "09:0000", "thustart": "09:0000", "tuestart": "09:0000", "wenstart": "09:0000"}', 'м. Филёвский парк.', NULL, '45268595', NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (98, NULL, 101, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Зеленоградский» Филиал «Крюково»', 'ГБУ ТЦСО «Зеленоградский» Филиал «Крюково»', NULL, NULL, 'krukovo.2014@yandex.ru', NULL, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания Зеленоградский филиал Крюково создан для выполнения работ, оказания услуг в целях обеспечения реализации предусмотренных федеральными законами, законами города Москвы, нормативными правовыми актами Правительства Москвы, полномочий города Москвы в сфере социальной защиты населения. Целями деятельности для которых создан Филиал является удовлетворение потребностей населения в доступном и качественном социальном обслуживании, организация нестационарного социального обслуживания, оказание гражданам и семьям с детьми, находящимся в трудной жизненной ситуации, социальных услуг. 
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (67, NULL, 66, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Чертаново» Филиал «Чертаново Северное»', 'ГБУ ТЦСО «Чертаново» Филиал «Чертаново Северное»', NULL, NULL, 'csochertanovosev@dszn.ru', 'http://www.tcso-chertanovo.ru', '<p>Функции Учреждения: - Обеспечивает предоставление социальной помощи на дому лицам, нуждающимся в этом виде обслуживания, а также организует работу отделений приема граждан, обработки информации, анализа и прогнозирования; дневного пребывания граждан пожилого возраста, инвалидов и несовершеннолетних детей, социально-медицинского обслуживания, срочного социального обслуживания, социальной помощи семье и детям. - Участвует в разработке мероприятий по организации социального обслуживания и социальной защиты граждан пожилого возраста, инвалидов, семей с детьми и других категорий граждан. - Совместно с органами и учреждениями социальной защиты, здравоохранения, внутренних дел, занятости, миграции, общественными объединениями многодетных, неполных семей, семей с детьми-инвалидами и другими организациями выявляет граждан, нуждающихся в социальной защите, причины и факторы социального неблагополучия конкретных семей, граждан пожилого возраста и инвалидов и их потребности в социальной помощи. - Ведет учет граждан, нуждающихся в социальной поддержке и обслуживании. - Оказывает социальные услуги в объеме территориального перечня гарантированных государством социальных услуг. - Осуществляет социальное сопровождение семей и детей, нуждающихся в социальной помощи и поддержке. - Оказывает помощь семьям в решении вопросов по преодолению трудных жизненных ситуаций. - Оказывает социальную поддержку и осуществляет мероприятия и социальное сопровождение по адаптации детей-сирот и детей, оставшихся без попечения родителей, выпускников интернатных учреждений, в возрасте до 23 лет. - Проводит работу по профилактике безнадзорности несовершеннолетних, защите их прав, участвует в работе по предупреждению алкоголизма, наркомании среди несовершеннолетних. - Проводит анализ уровня социального обслуживания семей с детьми, граждан пожилого возраста и инвалидов, прогнозирует их потребности в социальной помощи и готовит предложения по развитию сферы социальных услуг. - Внедряет новые формы и виды социального обслуживания. - Проводит мероприятия по повышению профессионального уровня работников Центра. - Участвует в привлечении различных организаций к решению вопросов оказания социальной помощи пенсионерам, инвалидам, семьям с детьми и отдельным гражданам. - Информирует население по вопросам социального обслуживания пенсионеров, инвалидов, семей, детей и отдельных граждан. - Участвует в подготовке мобилизационных мероприятий в порядке, установленном нормативными правовыми актами Российской Федерации и города Москвы</p>', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', NULL, NULL, NULL, NULL, 0);
