INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (229, NULL, NULL, 'Государственное бюджетное учреждение города Москвы Дом ветеранов сцены им. А.А.Яблочкиной Департамента социальной защиты населения города Москвы', 'ГБУ ДВС им. А.А. Яблочкиной', NULL, NULL, 'dvs@dszn.ru', NULL, NULL, NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "f", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "17:30:00", "monend": "17:30:00", "satend": "18:00:00", "sunend": "18:00:00", "thuend": "17:30:00", "tueend": "17:30:00", "wenend": "17:30:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "09:00:00", "sunstart": "09:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', 'метро Комсомольская, (далее пригородным электропоездом до станции Крюково), далее автобусом № 2,3,9,11 до остановки Универсам. От станции метро Речной вокзал можно доехать на автобусе № 400 или 400 (экспресс). Маршрут этого автобуса удобен тем, кто едет в старые районы Зеленограда (1-12) и Крюково. Чтобы удобнее добраться от метро до остановки автотранспорта, выходите на сторону ближнюю к первому вагону метро, по направлению из центра. Из метро - налево, мимо торгового центра. От станции метро Митино можно доехать на автобусе № 400К. Маршрут движения этого транспорта удобен тем, кто едет в новые районы Зеленограда (14-20) и Крюково. От станции метро Тушинская можно уехать в Зеленоград на автобусе-экспрессе или на маршрутке № 160. Этот маршрут удобен в случае, если вы едете в новые районы Зеленограда: Крюково, 14-16, 18, 20. Чтобы удобнее добраться до остановки транспорта, выходите из первого вагона из центра, в переходе держитесь левой стороны и при выходе наверх, поворачивайте направо, - остановка автобуса находится возле аптеки на проспекте Стратонавтов.', NULL, '45272576', NULL, 0);
