INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (41, NULL, 40, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Новогиреево» Филиал «Перовский»', 'ГБУ ТЦСО «Новогиреево» Филиал «Перовский»', NULL, NULL, 'filial-perovskiy@dszn.ru', 'http://tcso-novogireevo.ru', 'В основе деятельности лежит оказание социально-экономической поддержки гражданам пожилого возраста, семьям с детьми, людям, попавшим в трудную жизненную ситуацию, поддержание активного образа жизни старшего поколения.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', NULL, NULL, NULL, NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (95, NULL, 94, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Тушино» Филиал «Куркино»', 'ГБУ ТЦСО «Тушино» Филиал «Куркино»', NULL, NULL, 'filial_kurkino@mail.ru', 'http://www.tcso-tushino.com', 'Центр имеет в своем распоряжении 1012,9 кв. м. площади, которые используются по направлениям деятельности. Филиал «Куркино» имеет особенное расположение, обусловленное разделением на 6 отдельных помещений, которые имеют отдельные входные группы: отделение социального обслуживания на дому (2 отделения), отделение социальной реабилитации инвалидов, специалисты отделения срочного социального обслуживания и первичного приема анализа и прогнозирования, отделение сопровождения семей с детьми, отделение дневного пребывания. Центр полностью приспособлен для инвалидов и маломобильных групп  населения, оснащен современным реабилитационным оборудованием, тренажерами и залами для лечебной физкультуры, двумя сенсорными комнатами (взрослая и детская), кабинетом галотерапии (соляная пещера), мастерскими для кружковой и клубной работы, актовым и обеденным залами, игровыми комнатами, танцевальным классом и медицинскими кабинетами. В Центре имеется автомобиль, оборудованный подъемным устройством для перевозки инвалидов-колясочников.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "fribe": "14:00", "fribs": "13:00", "monbe": "14:00", "monbs": "13:00", "satbe": "14:00", "satbs": "13:00", "sunbe": "14:00", "sunbs": "13:00", "thube": "14:00", "thubs": "13:00", "tuebe": "14:00", "tuebs": "13:00", "wedbe": "14:00", "wedbs": "13:00", "friend": "18:45:00", "monend": "20:00:00", "satend": "17:00:00", "sunend": "18:00:00", "thuend": "20:00:00", "tueend": "20:00:00", "wenend": "20:00:00", "fristart": "09:00:00", "monstart": "09:00:00", "satstart": "09:00:00", "sunstart": "09:00:00", "thustart": "09:00:00", "tuestart": "09:00:00", "wenstart": "09:00:00"}', 'м. «Щелковская» далее авт. № 52, 68 или м. «Первомайская», тр. № 55 до остановки "Площадь Советских юнг"', NULL, NULL, NULL, 0);
