INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (2848, NULL, 63, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Царицынский» Филиал "Зябликово"', 'ГБУ ТЦСО «Царицынский» Филиал "Зябликово"', NULL, NULL, 'Cartcsoz@dszn.ru', 'http://tcso-caricinskiy.ru', '<p>Филиал &laquo;Зябликово&raquo; начал функционировать с 5 ноября 1998 года. Штатная численность сотрудников филиала составляет 65 человек, из них 45 &ndash; социальные работники. Работа филиала строится в соответствии с федеральным законом № 442-ФЗ &quot;Об основах социального обслуживания&quot;. В филиале функционируют следующие структурные подразделения: 4 отделения социального обслуживания на дому; 1,5 отделения дневного пребывания. Отделение дневного пребывания (ОДП) ежедневно посещают 45 человек. Клиенты ОДП организованно проводят свой досуг, в отделении регулярно проводятся концерты профессиональных коллективов и художественной самодеятельности, тематические встречи с интересными людьми, литературные вечера, мастер-классы, организована работа кружков.</p>
