INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (28, NULL, 26, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Бабушкинский» Филиал «Отрадное»', 'ГБУ ТЦСО «Бабушкинский» Филиал «Отрадное»', NULL, NULL, 'tcso-9_otradnoe@mail.ru', 'http://cso1.ru/', 'В результате происходящих социально-экономических и политических перемен в нашей стране возникла необходимость в создании такой организации, куда можно обратиться за экономической помощью, моральной, психологической или юридической поддержкой. Всё это может представить государственное бюджетное учреждение Территориального центра социального обслуживания №9 филиал Отрадное (ГБУ ТЦСО №9 филиал Отрадное).
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (34, NULL, 32, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Ярославский» Филиал «Лосиноостровский»', 'ГБУ ТЦСО «Ярославский» Филиал «Лосиноостровский»', NULL, NULL, 'tcso.yar_losinka@dszn.ru', 'http://tcso-yar.ru/', 'ГБУ ЦСО «Лосиноостровский» был открыт в ноябре 1994 года для граждан, попавших в сложную жизненную ситуацию и  нуждающихся в социальной помощи. Коллектив Центра состоит из профессиональных опытных работников, готовых прийти на помощь в любую минуту. 
