INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (91, NULL, 90, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Щукино» Филиал «Строгино»', 'ГБУ ТЦСО «Щукино» Филиал «Строгино»', NULL, NULL, 'filial.strogino@dszn.ru', 'http://tcso-schukino.ru/', 'В нашем Центре предоставляется социальная помощь гражданам пожилого возраста и инвалидам, семьям с детьми, а также другим гражданам, находящимся в трудной жизненной ситуации и остро нуждающимся в социальной поддержке.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (42, NULL, 40, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Новогиреево» Филиал «Ивановский»', 'ГБУ ТЦСО «Новогиреево» Филиал «Ивановский»', NULL, NULL, 'filial-ivanovskiy@dszn.ru', 'http://tcso-novogireevo.ru', 'Территориальный центр социального обслуживания Новогиреево филиал Ивановский создан 28 сентября 2012 года на базе центра социального обслуживания «Ивановский» 
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (25, NULL, 21, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Алексеевский» Филиал «Бутырский»', 'ГБУ ТЦСО «Алексеевский» Филиал «Бутырский»', NULL, NULL, 'alekseevskiy-but@dszn.ru', NULL, 'Бутырский район - один из старейших районов Москвы, где проживает около 67,5 тысяч человек, из которых приблизительно четвертая часть – это пенсионеры и другие граждане льготных категорий. Именно для помощи наиболее нуждающимся жителям района был создан Центр социального обслуживания «Бутырский», которому 1 сентября 2012 г. исполнилось 15 лет.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (44, NULL, 43, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Сокольники» Филиал «Преображенское»', 'ГБУ ТЦСО «Сокольники» Филиал «Преображенское»', NULL, NULL, 'cso_preobr@mail.ru', NULL, 'ЦСО Преображенское организован в январе 1999 года, открыт для социального обслуживания в августе 1999 года
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (51, NULL, 49, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Кузьминки» Филиал «Рязанский»', 'ГБУ ТЦСО «Кузьминки» Филиал «Рязанский»', NULL, NULL, 'tcso_razan@dszn.ru', 'http://tcsokuzminki.ru/', 'Филиал Рязанский является одним из 4-х подразделений Территориального центра социального обслуживания "Кузьминки" ДСЗН г. Москвы.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (52, NULL, 49, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Кузьминки» Филиал «Печатники»', 'ГБУ ТЦСО «Кузьминки» Филиал «Печатники»', NULL, NULL, 'matveevaAV1@social.mos.ru', 'http://tcsokuzminki.ru/', 'Оказание мер социальной поддержки пожилым гражданам и инвалидам, проживающим в районе Печатники. Учреждение оборудовано входным пандусом.', NULL, NULL, NULL, '{"fri": "t", "mon": "t", "sat": "t", "sun": "f", "thu": "t", "tue": "t", "wen": "t", "friend": "18:45", "monend": "20:00", "satend": "17:00", "sunend": "18:00", "thuend": "20:00", "tueend": "20:00", "wenend": "20:00", "fristart": "09:00", "monstart": "09:00", "satstart": "09:00", "sunstart": "09:00", "thustart": "09:00", "tuestart": "09:00", "wenstart": "09:00"}', 'Павелецкий вокзал, ст. Ступино, с. Лужники, ПНИ №13', NULL, NULL, NULL, 0);
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (92, NULL, 90, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Щукино» Филиал «Митино»', 'ГБУ ТЦСО «Щукино» Филиал «Митино»', NULL, NULL, 'filial.mitino@dszn.ru', 'http://www.tcso32.ru/', 'Центр социального обслуживания «Митино» открылся и начал работу в мае 1994 года  и располагался адресу: ул. Митинская д.55. В центре работало отделение срочного социального обслуживания и три отделения обслуживания граждан на дому. Центр обслуживал жителей района Митино и села Куркино.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (59, NULL, 57, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Коломенское» Филиал «Донской»', 'ГБУ ТЦСО «Коломенское» Филиал «Донской»', NULL, NULL, 'tcsokolom@dszn.ru', NULL, 'ГБУ ТЦСО «Коломенское» филиал «Донской» располагается в встроено-пристроенном здании, год постройки 1979 г.,1 этаж, общая площадь 954,7 кв.м., здание находится в оперативном управлении: свидетельство № 282935 от 10.01.2014 г.
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (64, NULL, 63, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Царицынский» Филиал «Бирюлево Восточное»', 'ГБУ ТЦСО «Царицынский» Филиал «Бирюлево Восточное»', NULL, NULL, 'Cartcsobv@dszn.ru', 'http://www.csobv.ru/', '<p>Центр социального обслуживания был основан в 1996 году, а в 2012 году путем слияния получил новый статус: филиал Бирюлево Восточное.</p>
INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (6, NULL, 4, 'Государственное бюджетное учреждение Территориальный центр социального обслуживания «Таганский» Филиал «Замоскворечье»', 'ГБУ ТЦСО «Таганский» Филиал «Замоскворечье»', NULL, NULL, 'csozam@mail.ru', NULL, 'Одним из основных направлений работы территориальных центров социального обслуживания и их филиалов является предоставление необходимых социальных и доврачебных услуг одиноким и одиноко проживающим пожилым гражданам и инвалидам, полностью или частично утративших способность к самообслуживанию через свои структурные подразделения, наиболее значимыми из них являются:
