INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (86, NULL, 251, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Ново-Переделкино» Филиал «Внуково»', 'ГБУ ТЦСО «Ново-Переделкино» Филиал «Внуково»', NULL, NULL, 'cso_vnukovo@mail.ru', NULL, 'Филиал «Внуково» предназначен для адресного обслуживания жителей района, нуждающихся в социальной поддержке: бытовой, медицинской, психологической, консультативной и иной помощи.Основные цели деятельности Филиала Внуково: Удовлетворение потребностей населения в доступном и качественном социальном обслуживании, организация нестационарного социального обслуживания, оказание гражданам, находящимся в трудной жизненной ситуации, необходимой социальной помощи.
