INSERT INTO public.agency (id, district_id, headagency_id, fullname, shortname, phone, address, email, www, description, edited_at, created_at, inn, timetable, address_comment, coords, okato, region_id, state) VALUES (32, 1, NULL, 'Государственное бюджетное учреждение города Москвы Территориальный центр социального обслуживания «Ярославский»', 'ГБУ ТЦСО «Ярославский»', NULL, 'Зеленоград, Юности, 309', 'tcso-11_Yaroslavskiy@mail.ru', 'http://tcso-yar.ru/', 'Государственное бюджетное учреждение города Москвы Территориальный  центр социального обслуживания Ярославский (далее Центр) является культурно-бытовым, медико-социальным учреждением, предназначенным для оказания различных видов социальной помощи и услуг инвалидам, одиноким престарелым гражданам и другим категориям населения, нуждающимся в социальной поддержке. В Центре работают люди разных профессий: социальные работники, социальные педагоги, психологи, юристы, медицинские работники, ставшие для многих жителей близкими и родными. Они всегда помогут советом, выслушают и окажут содействие в трудной жизненной ситуации. 
