INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (23, 'Молжаниновский', 0, 1, 'Молжаниновский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 2625 гектаров в нём насчитывается 29 улиц. Численность проживающего здесь населения составляет порядка 2 тысяч человек. Управление районом осуществляет Управа Молжаниновского района и прочие районные органы власти.');
