INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (24, 'Савёловский', 0, 1, 'Савёловский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 270 гектаров в нём насчитывается 32 улицы и 1 станция метро (Дмитровская). Численность проживающего здесь населения составляет порядка 57 тысяч человек. Управление районом осуществляет Управа Савёловского района и прочие районные органы власти.');
