INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (34, 'Лианозово', 0, 2, 'Район Лианозово входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 660 гектаров в нём насчитывается 28 улиц и 1 станция метро (Алтуфьево). Численность проживающего здесь населения составляет порядка 77 тысяч человек. Управление районом осуществляет Управа района Лианозово и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (35, 'Лосиноостровский', 0, 2, 'Лосиноостровский район входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 554 гектара в нём насчитывается 22 улицы. Численность проживающего здесь населения составляет порядка 72 тысяч человек. Управление районом осуществляет Управа Лосиноостровского района и прочие районные органы власти.');
