INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (13, 'Аэропорт', 0, 1, 'Район Аэропорт не считается спальным. Его инфраструктура находится на высоком уровне, здесь присутствуют промышленные предприятия, ВУЗы, НИИ, а также множество кинотеатров, театров и магазинов. В 1960 году в районе был построен аэровокзал, который функционирует и по сей день.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (12, 'Мещанский', 0, 3, 'Мещанский район, местность которого известна со времён основания Москвы, насчитывает сегодня 75% археологических заповедников, находящихся на территории столицы. Район обладает уникальными культурными ресурсами, привлекающими москвичей и гостей города. Большинство исторических зданий района относятся к объектам исторического и культурного наследия федерального и регионального значения.
