INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (39, 'Южное Медведково', 0, 2, 'Район Южное Медведково входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 400 гектаров в нём насчитывается 11 улиц. Численность проживающего здесь населения составляет порядка 65 тысяч человек. Управление районом осуществляет Управа района Южное Медведково и прочие районные органы власти.');
