INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (9, 'Тверской', 0, 3, 'Район получил своё название от главной Московской магистрали — Тверской улицы. Сегодня это один из самых перспективных сегментов столичного мегаполиса. История московского центра и его традиции неотделимы от истории этого района.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (8, 'Хамовники', 0, 3, 'Район Хамовники расположен на берегу Москвы-реки. Он гармонично вписался в прибрежный природный ландшафт, полностью сохранив в своём современном облике архитектуру прошлых столетий. На территории района расположено множество культурных памятников: Храмы, монастыри, музеи, исторические здания и сооружения — которые бережно сохраняются и реконструируются.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (6, 'Красносельский', 0, 3, 'В старину эти места называли Красное (то есть красивое) село. Ныне Красносельский — один из самых активно развивающихся районов Москвы, застроенный, в основном, в советское время.
