INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (56, 'Восточное Измайлово', 0, 4, 'Этот район столицы можно назвать «спальным», его спецификой является отсутствие промышленных предприятий, наличие научно-исследовательских, образовательных, и медицинских учреждений. Благодаря Измайловскому лесопарку и тенистым бульварам район Восточное Измайлово — один из самых зелёных районов Москвы, любимое место прогулок не только жителей района, но и многих москвичей.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (93, 'Чертаново Центральное', 0, 6, NULL);
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (3, 'Арбат', 0, 3, 'Арбат — это один из старейших районов столицы с более чем 500-летней историей, и множеством памятников архитектуры, истории и культуры. Назван по имени, расположенной здесь, улицы Арбат.
