INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (55, 'Ивановское', 0, 4, 'В нынешнем виде район образовался по распоряжению Мэра Москвы Ю.М. Лужкова 22 декабря 1994 года. В целях совершенствования структуры исполнительной власти территории двух микрорайонов Южное Измайлово и Ивановское были объединены в один район с названием Ивановское. Уже позднее к району были присоединены зоны отдыха «Терлецкая дубрава» и «Лебедянский пруд».');
