INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (42, 'Ростокино', 0, 2, 'Район Ростокино входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 440 гектаров в нём насчитывается 16 улиц и 1 станция метро (Ботанический сад). Численность проживающего здесь населения составляет порядка 29 тысяч человек. Управление районом осуществляет Управа района Ростокино и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (41, 'Отрадное', 0, 2, 'Район Отрадное входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 1020 гектаров в нём насчитывается 22 улицы и 2 станции метро (Владыкино и Отрадное). Численность проживающего здесь населения составляет порядка 170 тысяч человек. Управление районом осуществляет Управа района Отрадное и прочие районные органы власти.');
