INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (29, 'Алексеевский', 0, 2, 'Алексеевский район входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 525.8 гектаров в нём насчитывается 27 улиц и 2 станции метро (Алексеевская и ВДНХ). Численность проживающего здесь населения составляет порядка 73 тысяч человек. Управление районом осуществляет Управа Алексеевского района и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (28, 'Хорошёвский', 0, 1, 'Хорошёвский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 854 гектара в нём насчитывается 34 улицы и 3 станции метро (Аэропорт, Беговая и Полежаевская). Численность проживающего здесь населения составляет порядка 56 тысяч человек. Управление районом осуществляет Управа Хорошёвского района и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (22, 'Левобережный', 0, 1, 'Район Левобережный входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 800 гектаров в нём насчитывается 12 улиц и 1 станция метро (Речной вокзал). Численность проживающего здесь населения составляет порядка 51 тысячи человек. Управление районом осуществляет Управа района Левобережный и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (21, 'Коптево', 0, 1, 'Район Коптево входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 508 гектаров в нём насчитывается 23 улицы. Численность проживающего здесь населения составляет порядка 85 тысяч человек. Управление районом осуществляет Управа района Коптево и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (20, 'Дмитровский', 0, 1, 'Дмитровский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 683.97 гектаров в нём насчитывается 22 улицы. Численность проживающего здесь населения составляет порядка 89 тысяч человек. Управление районом осуществляет Управа Дмитровского района и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (19, 'Западное Дегунино', 0, 1, 'Район Западное Дегунино входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 734 гектара в нём насчитывается 20 улиц. Численность проживающего здесь населения составляет порядка 61 тысячи человек. Управление районом осуществляет Управа района Западное Дегунино и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (18, 'Восточное Дегунино', 0, 1, 'Район Восточное Дегунино входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 377.1 гектар в нём насчитывается 12 улиц. Численность проживающего здесь населения составляет порядка 97 тысяч человек. Управление районом осуществляет Управа района Восточное Дегунино и прочие районные органы власти.');
