INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (17, 'Головинский', 0, 1, 'Головинский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 880.65 гектаров в нём насчитывается 25 улиц и 1 станция метро (Водный стадион). Численность проживающего здесь населения составляет порядка 83 тысяч человек. Управление районом осуществляет Управа Головинского района и прочие районные органы власти.');
