INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (11, 'Пресненский', 0, 3, 'Пресненский район — один из наиболее индустриально развитых районов Москвы. Однако, ввиду строительства крупнейшего в Европе Московского международного делового центра «Москва-Сити» и программы вывода предприятий из центра города, район постепенно теряет свой промышленный потенциал. Особенностями Пресненского района являются высокая концентрация учреждений науки, культуры и образования, а так же наличие множества историко-архитектурных памятников.
