INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (10, 'Таганский', 0, 3, 'Таганский район — один из старейших районов столицы, который является неотъемлемой частью культурного и исторического центра Москвы. Район располагается в юго-восточной части центра города, между Яузой и Москвой-рекой. В далёком прошлом район назывался Заяузьем, территория которого росла и заселялась по мере развития основного ядра города, и сегодня его можно назвать одним из крупнейших по площади и количеству жителей районов ЦАО.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (7, 'Якиманка', 0, 3, 'Район Якиманка, получивший своё название от одноименной улицы, является одним из старейших районов Москвы. Здесь присутствует хорошо развитая инфраструктура, низкая плотность населения, отсутствие объектов массового назначения, единая социальная среда и хорошая транспортная доступность. Все эти факторы определяют весьма высокий рейтинг района.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (4, 'Басманный', 0, 3, 'Басманный район занимает особое место среди районов Москвы, и имеет ряд собственных, только ему характерных черт, присущих самобытной территории в сердце большого города. История его возникновения и развития — это история русской науки, культуры и искусства.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (5, 'Замоскворечье', 0, 3, 'Район Замоскворечье расположен в излучине реки Москвы, на правом её берегу, к югу от Кремля. Район отличается яркой историко-культурной и градостроительной спецификой, обладает рядом исторических, культурных, социальных и производственных особенностей. Здесь сосредоточенны многие из важнейших достопримечательностей Москвы.
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (37, 'Марьина роща', 0, 2, 'Район Марьина роща входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 467 гектаров в нём насчитывается 58 улиц и 2 станции метро (Марьина роща и Савёловская). Численность проживающего здесь населения составляет порядка 62 тысяч человек. Управление районом осуществляет Управа района Марьина роща и прочие районные органы власти.');
INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (43, 'Свиблово', 0, 2, 'Район Свиблово входит в состав 17-и районов Северо-Восточного административного округа города Москвы. Район занимает территорию в 455 гектаров в нём насчитывается 25 улиц и 2 станции метро (Ботанический сад и Свиблово). Численность проживающего здесь населения составляет порядка 49 тысяч человек. Управление районом осуществляет Управа района Свиблово и прочие районные органы власти.');
