INSERT INTO public.city_region (id, name, state, district_id, description) VALUES (26, 'Тимирязевский', 0, 1, 'Тимирязевский район входит в состав 16-и районов Северного административного округа города Москвы. Район занимает территорию в 1592 гектара в нём насчитывается 29 улиц и 2 станции метро (Петровско-Разумовская и Тимирязевская). Численность проживающего здесь населения составляет порядка 83 тысяч человек. Управление районом осуществляет Управа Тимирязевского района и прочие районные органы власти.');
