INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (143, 'Обеспечение необходимого ухода с учетом состояния здоровья получателя социальных услуг.', NULL, NULL, '["оценка состояния здоровья клиента (в том числе – обследование клиента на предмет развития пролежней и/или риска их появления)","составление графика оказания санитарно-гигиенических услуг клиенту, с учетом режимных моментов, индивидуальных медицинских показаний","обработка пролежней – по назначению врача","получение расходных материалов для оказания санитарно- гигиенических услуг клиенту (средства гигиены, моющие средства, ножницы, расчески, зубные щетки, простыни, полотенца, мочалки, клеенка и иные материалы)","оказание услуг клиенту в соответствии с графиком и по мере необходимости","гигиенические мероприятия (обмывание, обтирание) производится 2 раза в день и по мере необходимости","проведение полного туалета (мытье лежачего больного в бане, ванне, душе полностью – 1 раз в неделю и по мере необходимости); стрижка ногтей – 1 раз в неделю","ежедневный уход за волосами, стрижка – 1 раз в месяц","вынос и обработка судна антисептическими препаратами – при необходимости","обучение клиента основным приемам ухода за собой","заполнение учетно-отчетной документации","помочь встать с постели – откинуть одеяло, спустить ноги клиента с кровати, приподнять голову, поднять туловище клиента с постели наиболее удобным захватом","помочь лечь в постель – посадить клиента на постель, уложить головой на подушку, положить ноги на постель, укрыть одеялом","помощь в одевании – подготовленную в соответствии с целью и сезоном обувь и одежду надеть на клиента","помощь в раздевании – снять с клиента одежду, обувь, убрать ее на место","помощь в умывании – умывание рук, лица, шеи, ушей водой либо с использованием гигиенических средств, вытирание полотенцем (салфеткой)","Помощь в принятии пищи, питья – подготовить клиента к приему пищи:","удобно усадить клиента (кормление осуществляется в сидячем или полусидящем положении – в зависимости от состояния клиента) вымыть руки клиенту","подготовить место для приема пищи (стол, тумбочку, поднос)","выбрать нужную посуду, столовые приборы","выбрать нужную посуду, столовые приборы","при приеме пищи учитывать: еда накладывается в присутствии клиента, при необходимости пища измельчается, подается небольшими порциями, пожелать клиенту приятного аппетита","после еды вымыть клиенту руки, вытереть лицо, убрать место приема пищи","Помощь в пользовании туалетом или судном:","сопроводить клиента до туалета","поправить одежду (до и после туалета)","помочь сесть на унитаз (или судно)","оставить клиента в покое, чтобы он был в туалете один (если это не противопоказано по состоянию здоровья)","подтереть или подмыть клиента","вымыть ему руки","при применении судна лежачим клиентам: помочь приподнять таз или повернуться, подставить судно. После использования судно очистить и дезинфицировать. В остальном, при использовании судна соблюдаются те же правила, что и при пользовании туалетом","Помощь в передвижении по дому и вне дома – удерживание, помощь при ходьбе, а также поддержка клиентов при передвижении с использованием технических средств реабилитации","Помощь в уходе за зубами или челюстью (чистка зубов (протезов), ротовой полости (языка, слизистой щек), полоскание ротовой полости)","Помощь в пользовании очками или слуховыми аппаратами – проверка технического состояния и безопасности очков, аппарата; помощь в установке аппарата и надевании очков и их снятии","Бритье бороды, усов (для мужчин) – удаление нежелательной растительности на лице (подготовка необходимых инструментов и места, подготовка клиента к процедуре, проведение процедуры бриться с соблюдением техники безопасности; уборка инструментов и места выполнения услуги)"]', '["Клиенту оказана помощь в выполнении повседневных бытовых процедур обеспечения надлежащей личной гигиены клиента."]', 90, NULL, NULL, NULL, 7, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
