лана занятий, инструкций по технике безопасности во время занятий","подготовка необходимых расходных материалов для организации работы","составление списка клиентов, желающих посещать кружок (клуб)","изучение индивидуальных программ (планов, карт) реабилитации и рекомендаций специалистов, комплектование групп","определение организационных моментов (общее количество занятий в году, месяце, частота занятий в неделю, их продолжительность)","проведение занятий в соответствии с графиком и планом работы","подготовка выставок работ клиентов в соответствии с планом работы организации и кружка (клуба)","заполнение индивидуальной программы (плана, карты) реабилитации клиента, учетно-отчетной документации","Обеспечение книгами и журналами, настольными играми:","выдача книг, журналов и настольных игр по желанию клиента","организация соревнований по настольным играм (шашки, шахматы и т.д.)"]', NULL, NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
