INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (16, 'Оказание первичной доврачебной медико-санитарной помощи в экстренной форме.', NULL, NULL, '["оценка обстановки и обеспечению безопасных условий для оказания первой помощи:","определение угрожающих факторов для собственной жизни и здоровья;","определение угрожающих факторов для жизни и ","здоровья пострадавшего;","устранение угрожающих факторов для жизни и здоровья;","прекращение действия повреждающих факторов на пострадавшего;","извлечение пострадавшего из труднодоступного места;","перемещение пострадавшего;","вызов скорой медицинской помощи, других специальных служб, сотрудники которых обязаны оказывать первую помощь в соответствии с федеральным законом или со специальным правилом;","определение наличия сознания у пострадавшего;","мероприятия по восстановлению проходимости дыхательных путей и определению признаков жизни у пострадавшего:","запрокидывание головы с подъемом подбородка;","выдвижение нижней челюсти;","определение наличия дыхания с помощью слуха, зрения и осязания;","определение наличия кровообращения, проверка пульса на магистральных артериях;","мероприятия по проведению сердечно-легочной реанимации до появления признаков жизни:","- давление руками на грудину пострадавшего;","- искусственное дыхание «Рот ко рту»","- искусственное дыхание «Рот к носу»","- искусственное дыхание с использованием устройства для искусственного дыхания;","мероприятия по поддержанию проходимости дыхательных путей:","придание устойчивого бокового положения;","запрокидывание головы с подъемом подбородка;","выдвижение нижней челюсти;","мероприятия по обзорному осмотру пострадавшего и временной остановке наружного кровотечения:","обзорный осмотр пострадавшего на наличие кровотечений;","пальцевое прижатие артерии;","наложение жгута;","максимальное сгибание конечности в суставе;","прямое давление на рану;","наложение давящей повязки;","мероприятия по подробному осмотру пострадавшего в целях выявления признаков травм, отравлений и других состояний, угрожающих его жизни и здоровью, и по оказанию первой помощи в случае выявления указанных состояний:","проведение осмотра головы;","проведение осмотра шеи;","проведение осмотра груди;","проведение осмотра спины;","проведение осмотра живота и таза;","проведение осмотра конечностей;","наложение повязок при травмах различных областей тела, в том числе окклюзионной (герметизирующей) при ранении грудной клетки);","проведение иммобилизации (с помощью подручных средств, аутоиммобилизация, с использованием изделий медицинского назначения;","фиксация шейного отдела позвоночника (вручную, подручными средствами, с использованием изделий медицинского назначения;","прекращение воздействия опасных химических веществ на пострадавшего (промывание желудка путем приема воды и вызывания рвоты, удаление с поврежденной поверхности и промывание поврежденной поверхности проточной водой);","местное охлаждение при травмах, термических ожогах и иных воздействиях высоких температур или теплового излучения;","термоизоляция при отморожениях и других эффектах воздействия низких температур;","придание пострадавшему оптимального положения тела;","контроль состояния пострадавшего (сознание, дыхание, кровообращение) и оказание психологической поддержки;","передача пострадавшего бригаде скорой медицинской помощи, другим специальным службам, сотрудники которых обязаны оказывать первую помощь в соответствии с федеральным законом или со специальным правилом."]', '["своевременность оказания первичной доврачебной медико-санитарной помощи в экстренной форме","аккуратность и осторожность выполнения процедур, связанных с оказанием первичной доврачебной медико-санитарной помощи получателю социальных услуг без причинения какого-либо вреда"]', 30, NULL, 157.50, NULL, 9, '0123', 1, NULL, 1, 2, 4, 1, 0, 1);
