INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (10, 'Содействие в организации предоставления услуг организациями торговли, организациями, оказывающими коммунальные услугу и услуги связи, а также другими организациями, оказывающими услуги населению.', '["Возможно использование электронного устройства"]', NULL, '["направление по просьбе получателя социальной услуги заявки по телефону или сети «Интернет» заявки на дистанционное приобретение промышленного или продовольственного товара, билетов на культурно-досуговые мероприятия","направление по просьбе получателя социальной услуги заявки на ремонт сантехнического, электрического, газового оборудования, бытовой техники, сборку (разборку) мебели","контроль над выполнением заявок на дистанционное приобретение промышленного или продовольственного товара, билетов на культурно-досуговые мероприятия, на ремонт сантехнического, электрического, газового оборудования, бытовой техники, сборку (разборку) мебели","отправка почтовой корреспонденции и заказных писем"]', '["своевременность направления (в день получения просьбы получателя социальных услуг) заявки по телефону или сети «Интернет» заявки на дистанционное приобретение промышленного или продовольственного товара, билетов на культурно-досуговые мероприятия, на ремонт сантехнического, электрического, газового оборудования, бытовой техники, сборку (разборку) мебели","полнота контроля над выполнением заявок на дистанционное приобретение промышленного или продовольственного товара, билетов на культурно-досуговые мероприятия, на ремонт сантехнического, электрического, газового оборудования, бытовой техники, сборку (разборку) мебели"]', 15, NULL, 78.75, NULL, 2, '1110', 1, NULL, 1, 2, 4, 1, 0, 1);
