INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (180, 'Оказание помощи родителям в воспитании детей, в том числе оказание помощи в конфликтных ситуациях.', NULL, NULL, '["выявление проблем","определение объема и видов предполагаемой помощи в условиях организации социального обслуживания, направления на иную помощь, не входящую в компетенцию организации","социально-психологическая помощь клиенту в раскрытии и мобилизации внутренних ресурсов, решение и профилактика этих социально-психологических проблем","выявление психологических проблем, стоящих перед клиентом (внутрисемейные, детско-родительские, межличностные, супружеские, иные отношения; эмоциональные особенности личности клиента, особенности развития и поведения клиента, внутриличностный конфликт клиента и иные проблемы), оказание помощи в формулировании запроса клиентом","сбор психологического анамнеза","разъяснение клиенту сути проблем и определение возможных путей их решения","определение реакции клиента на имеющиеся проблемы и уровня мотивации к их преодолению","разработка для клиента рекомендаций по решению стоящих перед ним психологических проблем","заполнение индивидуальной программы (плана, карты) реабилитации клиента"]', '["Социально-психологическое консультирование должно на основе полученной от клиента информации и обсуждения с ним возникших социально-психологических проблем помочь ему раскрыть и мобилизовать внутренние ресурсы для решения этих проблем."]', NULL, NULL, NULL, NULL, 17, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (165, 'Услуги по организации питания, быта и досуга.', NULL, NULL, NULL, '["В период пребывания в организации социального обслуживания клиенту оказываются услуги по организации питания, быта и досуга"]', NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (181, 'Оказание комплексной психолого-педагогической помощи.', NULL, NULL, '["выявление проблем","определение объема и видов предполагаемой помощи в условиях организации социального обслуживания, направления на иную помощь, не входящую в компетенцию организации","социально-психологическая помощь клиенту в раскрытии и мобилизации внутренних ресурсов, решение и профилактика этих социально-психологических проблем","выявление психологических проблем, стоящих перед клиентом (внутрисемейные, детско-родительские, межличностные, супружеские, иные отношения; эмоциональные особенности личности клиента, особенности развития и поведения клиента, внутриличностный конфликт клиента и иные проблемы), оказание помощи в формулировании запроса клиентом","сбор психологического анамнеза","разъяснение клиенту сути проблем и определение возможных путей их решения","определение реакции клиента на имеющиеся проблемы и уровня мотивации к их преодолению","разработка для клиента рекомендаций по решению стоящих перед ним психологических проблем","заполнение индивидуальной программы (плана, карты) реабилитации клиента."]', '["Социально-психологическое консультирование должно на основе полученной от клиента информации и обсуждения с ним возникших социально-психологических проблем помочь ему раскрыть и мобилизовать внутренние ресурсы для решения этих проблем."]', NULL, NULL, NULL, NULL, 17, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (82, 'Оказание санитарно-гигиенических услуг.', NULL, NULL, '["обмывание, обтирание, смена абсорбирующего белья по мере необходимости, но не менее двух раза в день","проведение полного туалета (мытье в ванне или душе полностью – по мере необходимости, но не реже 1 раза в неделю)","стрижка ногтей – 1 раз в неделю","ежедневный уход за волосами, стрижка – 1 раз в месяц","вынос и обработка судна антисептическими препаратами – по мере необходимости","обучение получателя социальных услуг основным приемам ухода за собой","помощь при вставании с постели – откинуть одеяло, спустить ноги с кровати, приподнять голову, поднять туловище с постели наиболее удобным захватом","помощь при отправлении в постель – посадить на постель, уложить головой на подушку, положить ноги на постель, укрыть одеялом","помощь в одевании – надеть подготовленную в соответствии с целью и сезоном обувь и одежду","помощь в раздевании: снять одежду, обувь, убрать ее на место хранения","помощь в умывании – умывание рук, лица, шеи, ушей водой либо с использованием гигиенических средств, вытирание полотенцем (салфеткой)","помощь в пользовании туалетом или судном: сопроводить получателя социальных услуг до туалета; поправить одежду (до и после туалета); помочь сесть на унитаз (или судно); подтереть или подмыть получателя социальных услуг; вымыть ему руки; при применении судна лежачим получателям социальных услуг: помочь приподнять таз или повернуться, подставить судно, после использования судно очистить и дезинфицировать. В остальном, при использовании судна соблюдаются те же правила, что и при пользовании туалетом","помощь в передвижении по дому и вне дома – удерживание, помощь при ходьбе, а также поддержка клиентов при передвижении с использованием технических средств реабилитации;","помощь в уходе за зубами или челюстью (чистка зубов (протезов), ротовой полости (языка, слизистой щек), полоскание ротовой полости)","помощь в пользовании очками или слуховыми аппаратами – проверка технического состояния и безопасности очков, аппарата; помощь в установке аппарата и надевании очков и их снятии","помощь в бритье бороды, усов (для мужчин) – удаление нежелательной растительности на лице (подготовка необходимых инструментов и места, подготовка получателя социальных услуг к процедуре, проведение процедуры бриться с соблюдением техники безопасности; уборка инструментов и места выполнения услуги)."]', '["своевременность оказания санитарно-гигиенических услуг","аккуратность и осторожность выполнения санитарно-гигиенических услуг"]', 90, NULL, 472.50, NULL, 7, '0125', 1, NULL, 1, 1, 4, 1, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (133, 'Предоставление жилой площади, помещений для реабилитационных, физкультурно-оздоровительных, спортивных, культурно-развлекательных мероприятий, лечебно-трудовой деятельности, бытового обслуживания.', NULL, NULL, '["Жилая площадь предоставляется клиентам в соответствии с санитарно-гигиеническими нормами.","При размещении клиентов в жилых помещения учитывается их физическое и психическое состояние, психологическая совместимость, наклонности."]', '["Помещения, предоставляемые для организации реабилитационных мероприятий, лечебно-трудовой и учебной деятельности, культурного и бытового обслуживания, по размерам, расположению и конфигурации должны обеспечивать проведение в них всех упомянутых выше мероприятий с учетом специфики обслуживаемого клиента."]', NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
