INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (20, 'Содействие в обеспечении по заключению медицинской организации лекарственными препаратами и медицинскими изделиями.', '["Тара для доставки заказанных товаров"]', '["Денежные средства"]', '["прием заказа от получателя социальных услуг или получение рецепта от врача","получение денежных средств от получателя социальных услуг на приобретение лекарственных средств или товаров медицинского назначения","закупка или получение бесплатных лекарственных средств и товаров медицинского назначения в аптеках","доставка лекарственных средств и товаров медицинского назначения на дому","произведение окончательного расчета с получателем социальных услуг по документам, подтверждающим оплату"]', '["своевременность приема заказа от получателя социальных услуг","аккуратность закупки или получения лекарственных средств или товаров медицинского назначения","своевременность доставки лекарственных средств и товаров медицинского назначения на дом"]', 60, NULL, 315.00, NULL, 8, '0129', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (23, 'Содействие в оформлении путевок на санитарно-курортное лечение.', NULL, NULL, '["запись на прием к соответствующим врачам-специалистам","сопровождение в рабочее время на прием к соответствующим врачам-специалистам и обратно","получение в медицинской организации справки по установленной форме о необходимости санаторно-курортного лечения","передача справки по установленной форме о необходимости санаторно-курортного лечения получателю социальных услуг","передача в уполномоченный орган социальной защиты населения Москвы документов, необходимых для оформления путевок на санаторно-курортное лечение","получение и передача получателю социальных услуг оформленной путевки на санаторно-курортное лечение"]', '["своевременность записи получателя социальных услуг на прием к соответствующим врачам-специалистам","аккуратность и своевременность сопровождения получателя социальных услуг на прием к соответствующим врачам-специалистам","своевременность передачи в уполномоченный орган социальной защиты населения Москвы документов, необходимых для оформления путевки на санаторно-курортное лечение"]', 60, NULL, 315.00, NULL, 8, '1212', 1, NULL, 1, 1, 3, 1, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (85, 'Психологический патронаж.', NULL, NULL, '["систематическое (в объеме, предусмотренном программой психологического сопровождения) наблюдение за психологическим состоянием получателя социальных услуг","систематическое (в объеме, предусмотренном программой психологического сопровождения) проведение бесед, тренингов, иных мероприятий в целях выхода из сложившейся ситуации"]', '["своевременность оказания психологического патронажа","стабилизация психологического состояния получателя социальных услуг"]', 30, NULL, 157.50, NULL, 17, '0132', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (136, 'Содействие в организации предоставления услуг организациями торговли, организациями, оказывающими услуги связи, проживающим в организациям стационарного социального обслуживания.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (75, 'Содействие в получении образования и (или) профессии инвалидам с учетом особенностей их психофизического развития, индивидуальных возможностей.', NULL, NULL, '["помощь в выборе вида образования или профессиональной деятельности в соответствии с интересами и возможностями получателя социальных услуг","предоставление информации об образовательных программах образовательных организаций, занимающихся обучением инвалидов","запись получателя социальной услуги на обучение в образовательную организацию","сбор документов для обучения получателя социальных услуг"]', '["своевременность предоставления информации об образовательных программах образовательных организаций","полнота сведений об образовательных организациях","аккуратность при сборе документов для обучения"]', 30, NULL, 157.50, NULL, 16, '0014', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (76, 'Содействие в трудоустройстве.', NULL, NULL, '["устное разъяснение получателю социальных услуг основ законодательного регулирования реализации права на труд","содействие в постановке на учет в органах службы занятости в качестве лица, ищущего работу (в случае, если возможность трудовой деятельности предусмотрена индивидуальной программой реабилитации)","содействие в решении вопросов профессионального обучения через органы службы занятости"]', '["информативность и доходчивость разъяснения получателю социальных услуг основ законодательного регулирования реализации права на труд","своевременность содействия постановки на учет в органах службы занятости в качестве лица, ищущего работу","своевременность решения вопросов организации профессионального обучения получателя социальных услуг через органы службы занятости"]', 30, NULL, 157.50, NULL, 18, '0015', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (24, 'Помощь в оформлении документов, исключая случаи оформления документов, затрагивающих интересы третьих лиц, оказание помощи в написании писем.', NULL, NULL, '["написание документов и заполнение форм документов, необходимых для реализации получателем социальных услуг своих прав","оказание помощи в сборе и подаче в органы государственной власти, органы местного самоуправления, иные наделенные публично-правовыми функциями организации документов (сведений), непосредственно затрагивающих права  получателя социальных услуг","осуществление контроля над ходом и результатами рассмотрения документов, поданных в органы государственной власти, органы местного самоуправления, иные наделенные публично-правовыми функциями организации"]', '["аккуратность и грамотность написания документов и заполнения форм документов, необходимых для реализации получателем социальных услуг своих прав","своевременность оказания помощи в сборе и подаче в органы государственной власти, органы местного самоуправления, иные наделенные публично-правовыми функциями организации необходимых документов","регулярность контроля над ходом и результатами рассмотрения документов, поданных в органы государственной власти, органы местного самоуправления, иные наделенные публично-правовыми функциями организации"]', 30, NULL, 157.50, NULL, 11, '0161', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (25, 'Содействие в получении мер социальной поддержки, в том числе льгот.', NULL, NULL, '["информирование о мерах социальной поддержки, предоставляемых в соответствии с федеральным и городским законодательством","информирование о перечне необходимых документов в соответствии с действующим законодательством для реализации прав на получение мер социальной поддержки","заполнение (оформление) документов, необходимых для назначения мер социальной поддержки","доставка необходимых для назначения мер социальной поддержки документов в уполномоченный орган социальной защиты города Москвы либо в многофункциональный центр предоставления государственных услуг города Москвы","контроль над ходом рассмотрения в уполномоченном органе социальной защиты населения документов, необходимых для назначения мер социальной поддержки","передача получателю социальных услуг оформленных документов о праве на льготы или информирование о предоставлении / отказе в предоставлении ему мер социальной поддержки."]', '["полнота информирования о мерах социальной поддержки, предоставляемых в соответствии с федеральным и городским законодательством","аккуратность заполнения (оформления) документов, необходимых для назначения мер социальной поддержки","регулярность контроля над ходом и результатами рассмотрения документов, представленных в уполномоченный орган социальной защиты населения Москвы для назначения мер социальной поддержки"]', 45, NULL, 236.25, NULL, 11, '0162', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (138, 'Обеспечение одеждой, обувью и постельными принадлежностями.', NULL, NULL, '["В период проживания в организации социального обслуживания. Смена постельного белья проживающих проводится по мере загрязнения, но не реже 1 раза в 7 дней.","Одежда, обувь подбирается по сезону, росту и размеру клиента и должна отвечать, по возможности, их запросам по фасону и расцветке, а также санитарно-гигиеническим нормам и требованиям."]', '["Клиент обеспечен мягким инвентарем (одеждой, обувью, нательным бельем, постельными принадлежностями)"]', NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (26, 'Оказание помощи по вопросам организации пенсионного обеспечения и предоставления других социальных выплат.', NULL, NULL, '["информирование по вопросам организации пенсионного обеспечения и предоставления других социальных выплат","информирование о перечне необходимых документов в соответствии с действующим законодательством для пенсионного обеспечения и предоставления других социальных выплат","заполнение (оформление) документов, необходимых для пенсионного обеспечения и предоставления других социальных выплат","доставка необходимых для пенсионного обеспечения и предоставления других социальных выплат  документов в уполномоченный орган Пенсионного фонда Российской Федерации, социальной защиты населения города Москвы либо в многофункциональный центр предоставления государственных услуг города Москвы","контроль над ходом рассмотрения в уполномоченном органе документов, необходимых для назначения пенсионного обеспечения и других социальных выплат","информирование получателя социальных услуг о предоставлении / отказе в предоставлении ему выплат."]', '["аккуратность и грамотность написания документов и заполнения форм документов, необходимых для пенсионного обеспечения и предоставления других социальных выплат","своевременность оказания помощи в сборе и подаче документов, необходимых для пенсионного обеспечения и предоставления других социальных выплат","регулярность контроля над ходом и результатами рассмотрения документов, поданных для пенсионного обеспечения и предоставления других социальных выплат"]', 45, NULL, 236.25, NULL, 11, '0163', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (27, 'Содействие в получении бесплатной юридической помощи в порядке, установленном законодательством.', NULL, NULL, '["информирование о порядке предоставления бесплатной юридической помощи в городе Москве, в том числе категорий лиц, имеющих на нее право и категорий дел, по которым она предоставляется","предоставление в соответствии с Федеральным законом от 21.11.2011 № 324-ФЗ «О бесплатной юридической помощи в Российской Федерации» информации об адвокатах оказывающих бесплатную юридическую помощь","помощь в получении в центрах предоставления государственных услуг или в отделах социальной защиты населения районов справки о среднедушевом доходе семьи или доходе одиноко проживающего гражданина и величине прожиточного минимума в городе Москве в целях оказания бесплатной юридической помощи гражданам, имеющим место жительства в городе Москве, среднедушевой доход семей которых ниже величины прожиточного минимума в городе Москве, либо одиноко проживающим гражданам, доходы которых ниже величины прожиточного минимума в городе Москве"]', '["своевременность содействия в получении бесплатной юридической помощи","полнота информации о порядке получения бесплатной юридической помощи"]', 30, NULL, 157.50, NULL, 11, '0164', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (150, 'Оказание психологической помощи, в том числе оказание консультативной, психологической помощи несовершеннолетним и их родителям.', NULL, NULL, '[" выявление проблем","определение объема и видов предполагаемой помощи в условиях организации социального обслуживания, направления на иную помощь, не входящую в компетенцию организации","социально-психологическая помощь клиенту в раскрытии и мобилизации внутренних ресурсов, решение и профилактика этих социально-психологических проблем","выявление психологических проблем, стоящих перед клиентом (внутрисемейные, детско-родительские, межличностные, супружеские, иные отношения; эмоциональные особенности личности клиента, особенности развития и поведения клиента, внутриличностный конфликт клиента и иные проблемы), оказание помощи в формулировании запроса клиентом","сбор психологического анамнеза","разъяснение клиенту сути проблем и определение возможных путей их решения","определение реакции клиента на имеющиеся проблемы и уровня мотивации к их преодолению","разработка для клиента рекомендаций по решению стоящих перед ним психологических проблем","заполнение индивидуальной программы (плана, карты) реабилитации клиента"]', '["Социально-психологическое консультирование должно на основе полученной от клиента информации и обсуждения с ним возникших социально-психологических проблем помочь ему раскрыть и мобилизовать внутренние ресурсы для решения этих проблем"]', NULL, NULL, NULL, NULL, 17, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (153, 'Обучение навыкам самообслуживания, поведения в быту и общественных местах, самоконтролю, навыкам общения и другим формам общественной жизни.', NULL, NULL, '["изучение личного дела клиента (несовершеннолетнего), результатов диагностики и рекомендаций специалистов;  определение актуального уровня социальной подготовленно","определение актуального уровня социальной подготовленности","определение зоны ближайшего уровня развития","выбор форм и методов работы с несовершеннолетним, составление индивидуальной программы занятий с ним","комплектование групп для занятий в соответствии с актуальным уровнем социальной подготовленности, индивидуальными личностными особенностями несовершеннолетних","определение организационных моментов (общее количество занятий в месяце, неделе, частота занятий в неделю, их продолжительность)","проведение занятий в соответствии с графиком, планом работы и правилами техники безопасности","заполнение индивидуальной программы (плана, карты) реабилитации несовершеннолетнего, учетно-отчетной документации","заполнение индивидуальной программы (плана, карты) реабилитации несовершеннолетнего, учетно-отчетной документации"]', '["Обучение детей-инвалидов навыкам самообслуживания, поведения в быту и обществе, самоконтролю, персональной сохранности и другим формам жизнедеятельности должно обеспечивать формирование личности ребенка.","Обучение основам домоводства выпускников интернатных учреждений, проживающих самостоятельно, должно быть наглядным и эффективным, способствующим освоению бытовых процедур (приготовление пищи, мелкий ремонт одежды, уход за квартирой и т.п.)."]', NULL, NULL, NULL, NULL, 16, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (185, 'Организация лечебно-оздоровительных мероприятий.', NULL, NULL, '["Организация проведения утренней гимнастики с клиентами:","изучение списка клиентов организации социального обслуживания, их медицинских показаний, состояния их здоровья","составление комплекса упражнений для проведения гимнастики (корректировка комплекса упражнений не реже 1 раза в 2 недели)","составление графика проведения гимнастики для каждой возрастной группы (отделения)","ознакомление социальных работников с разработанным графиком","выбор помещения для проведения гимнастики","проведение гимнастики в соответствии с разработанным графиком в течение 10-15 минут.","Организация и проведение спортивных соревнований и праздников:","разработка сценария спортивного мероприятия","подбор ведущих","отбор членов команд (формирование команд в соответствии с медицинскими показаниями состояния здоровья клиентов)","подготовка необходимого реквизита, поощрительных призов и иное","проверка наличия у клиентов спортивной формы, кроссовок (кед)","оформление места проведения спортивного мероприятия","составление графика и проведение отборочных соревнований, подготовительных занятий, тренировок","осуществление взаимодействия с другими специалистами организации в процессе подготовки спортивного мероприятия (музыкальным работником, воспитателем, специалистами по социальной работе и другими)","приглашение на спортивное мероприятие гостей (руководителей организации, родителей, специалистов по физической культуре учреждений образования и спорта, благотворителей и других)","проведение инструктажей для участников спортивного мероприятия по технике безопасности","проведение спортивного мероприятия","ознакомление с отзывами, мнениями работников, клиентов, гостей организации о проведенном мероприятии","ознакомление с отзывами, мнениями работников, клиентов, гостей организации о проведенном мероприятии","подготовка отчета о проведенном мероприятии.","Организация работы групп здоровья:","разработка годового (ежемесячного)плана работы «групп здоровья»","разработка тематики и плана занятий, инструкций по технике безопасности во время занятий","составление списка клиентов, желающих посещать «группы здоровья»","изучение индивидуальных программ (планов, карт) реабилитации клиентов","комплектование групп для занятий в соответствии с интересами и пожеланиями клиентов, медицинскими показаниями состояния их здоровья","определение организационных моментов (общее количество занятий в году, месяце, неделе, частота занятий в неделю, их продолжительность)","проведение занятий в соответствии с графиком и планом работы","заполнение индивидуальной программы / плана / карты реабилитации клиента."]', '["Организация и проведение физкультуры, занятий физкультурой и спортом, прогулок на свежем воздухе; дневного сна, водных процедур, закаливание (принятие воздушных ванн).","Организация лечебных режимов (по назначению врача), в том числе проведение прививок согласно национальному календарю профилактических прививок (приказ МЗ РФ от 27.06.2001 No 229 «О национальном календаре профилактических прививок и календаря профилактических прививок по эпидемическим показателям»)."]', NULL, NULL, NULL, NULL, 10, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (157, 'Содействие в получении бесплатной юридической помощи в порядке, установленном законодательством.', NULL, NULL, '["Выяснение ситуации клиента, информирование о перечне необходимых документов в соответствии с действующим законодательством для реализации его законных прав","разъяснение назначения и содержания документов","помощь в оформлении документов"]', '["Выяснение жизненной ситуации клиента, информирование клиента о путях реализации его законных прав, разъяснение права на получение бесплатной юридической помощи согласно Федеральному закону от 21.11.2011 No 324-ФЗ «О бесплатной юридической помощи в Российской Федерации»."]', NULL, NULL, NULL, NULL, 11, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (158, 'Содействие в сохранении жилых помещений, принадлежащих на праве собственности либо на праве самостоятельного пользования в течение всего времени проживания в организации стационарного социального обслуживания, а также во внеочередном обеспечении жилым помещением в случае отказа от услуг стационарного социального обслуживания по истечении указанного срока, если ранее занимаемое жилое помещение было передано городу Москве и предоставлено иным гражданам в установленном порядке.', NULL, NULL, NULL, '["Оказание содействия в сохранении жилых помещений получателей социальных услуг, принадлежащих на праве собственности либо на праве самостоятельного пользования в течение всего времени проживания в организации стационарного социального обслуживания, а также во внеочередном обеспечении жилым помещением в случае отказа от услуг социального обслуживания в стационарной форме по истечении указанного срока, если ранее занимаемое жилое помещение было передано городу Москве и предоставлено иным гражданам в установленном порядке"]', NULL, NULL, NULL, NULL, 11, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (159, 'Обучение инвалидов (детей-инвалидов) пользованию средствами ухода и техническими средствами реабилитации.', NULL, NULL, '["изучение личного дела клиента, результатов диагностического обследования и рекомендаций специалистов","определение реабилитационного потенциала клиента по записям специалистов МСЭ","подбор технических средств реабилитации в соответствии с типом и структурой дефекта, особенностями психофизического развития и реабилитационным потенциалом клиента","выбор форм и методов работы с клиентом","разработка тематики и плана занятий, инструкций по технике безопасности во время занятий","подготовка необходимых технических средств реабилитации, наглядных пособий (таблиц, рисунков, карт, схем) для организации занятий","определение организационных моментов (общее количество занятий в месяце, неделе, частота занятий в неделю, их продолжительность, место проведения)","проведение занятий в соответствии с графиком и планом работы (не менее 10 сеансов)","заполнение индивидуальной программы (плана, карты) реабилитации клиента, учетно-отчетной документации"]', '["У клиента развиты практические навыки умения самостоятельно пользоваться техническими средствами реабилитации"]', NULL, NULL, NULL, NULL, 16, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (160, 'Проведение социально-реабилитационных мероприятий в сфере социального обслуживания.', NULL, NULL, '["изучение истории болезни, индивидуальной программы реабилитации клиента, медицинской карты клиента, рекомендаций специалистов службы МСЭ, специалистов организации социального обслуживания","назначение в соответствии с рекомендациями специалистов службы МСЭ, медицинскими показаниями, состоянием здоровья клиента курса прохождения реабилитационных (адаптационных) мероприятий (лечебная физкультура, физиопроцедуры, восстановительная терапия: прием лекарств, подкожные, внутримышечные и внутривенные инъекции, занятия на тренажерах и иные мероприятия)","выбор формы проведения реабилитационных (адаптационных) мероприятий (индивидуальные, групповые)","составление каждым специалистом индивидуального графика проведения реабилитационных (адаптационных) мероприятий социально-медицинского характера с учетом режимных моментов, индивидуальных медицинских показаний, пожеланий клиента","проведение реабилитационных (адаптационных) мероприятий в соответствии с разработанным графиком","заполнение истории болезни клиента, индивидуальной программы (плана, карты) реабилитации клиента, журнала посещения занятий","организация амбулаторного посещения реабилитационного учреждения в пределах города Москвы","оценка результативности проводимых реабилитационных мероприятий"]', '["Содействие в проведении и проведение социально-реабилитационных мероприятий, в том числе в соответствии с индивидуальной программой реабилитации:  изучение истории болезни, индивидуальной программы"]', NULL, NULL, NULL, NULL, 10, NULL, 1, NULL, 2, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (186, 'Предоставление медико-социального ухода с учетом состояния здоровья получателя социальных услуг.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (167, 'Организация культурно-досуговых мероприятий.', NULL, NULL, '["Организация культурно-массовых мероприятий за пределами организации:","заключение договоров с организациями, предприятиями, музеями, театрами о предоставлении услуг (помещение выставок спектаклей и иных мероприятий), получение у руководителя билетов на посещение мероприятий","составление списков клиентов для посещения культурно-массовых мероприятий за пределами организации","тематическая подготовка клиентов (в том числе детей) к посещению культурно-массовых мероприятий за пределами организации (проведение тематические бесед и иное)","проведение инструктажа с клиентами о правилах поведения в общественных местах и при перевозке к месту проведения мероприятия","назначение сопровождающих лиц, закрепление за ними ответственности за жизнь и здоровье клиентов","организация доставки клиентов к месту проведения культурно-массового мероприятия","ознакомление с отзывами, мнениями клиентов о проведенном мероприятии","заключительная беседа по итогам проведенного мероприятия","подготовка отчета о проведенном мероприятии","Организация кружковой (клубной) работы:","разработка тематики и плана занятий, инструкций по технике безопасности во время занятий","подготовка необходимых расходных материалов для организации работы","составление списка клиентов, желающих посещать кружок (клуб)","изучение индивидуальных программ (планов, карт) реабилитации и рекомендаций специалистов, комплектование групп","определение организационных моментов (общее количество занятий в году, месяце, частота занятий в неделю, их продолжительность)","проведение занятий в соответствии с графиком и планом работы","подготовка выставок работ клиентов в соответствии с планом работы организации и кружка (клуба)","заполнение индивидуальной программы (плана, карты) реабилитации клиента, учетно-отчетной документации","Обеспечение книгами и журналами, настольными играми:","выдача книг, журналов и настольных игр по желанию клиента","организация соревнований по настольным играм (шашки, шахматы и т.д.)"]', '["Проведение разнообразных видов социокультурной деятельности","Расширение общего и культурного кругозора клиента"]', NULL, NULL, NULL, NULL, 2, NULL, 1, NULL, 3, 0, NULL, NULL, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (83, 'Содействие в проведении реабилитационных мероприятий (медицинских, социальных), в том числе для инвалидов, на основании индивидуальных программ реабилитации.', NULL, NULL, '["получение и доставка абсорбирующего белья на дом","помощь в выборе технических средств реабилитации","консультирование по обустройству жилого помещения с учетом индивидуальных ограничений жизнедеятельности"]', '["своевременность доставки абсорбирующего белья на дом","своевременность помощи в выборе технических средств реабилитации","своевременность и полнота консультаций по обустройству жилого помещения с учетом индивидуальных ограничений жизнедеятельности"]', 60, NULL, 315.00, NULL, 10, '0128', 1, NULL, 1, 2, 4, 1, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (4, 'Покупка и доставка за счет средств получателя социальных услуг на дом промышленных товаров первой необходимости.', '["Тара для доставки заказанных товаров"]', '["Денежные средства"]', '["прием заказа от получателя социальных услуг (вес набора не должен превышать 4 килограмм на одного получателя социальных услуг или 7 килограмм на двух и более получателей социальных услуг)","получение наличных денежных средств от получателя социальных услуг на приобретение промышленных товаров первой необходимости","покупка промышленных товаров первой необходимости","доставка промышленных товаров первой необходимости на дом","окончательный расчет с получателем социальных услуг по чеку"]', '["доброкачественность промышленных товаров первой необходимости, доставляемых на дом по списку, согласованному с получателем социальных услуг","своевременное удовлетворение нужд и потребностей получателей социальных услуг в промышленных товарах первой необходимости","соответствие приобретаемых промышленных товаров первой необходимости пожеланиям получателя социальной услуги"]', 30, NULL, 157.50, NULL, 2, '0114', 1, NULL, 1, 1, 1, 2, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (5, 'Оказание помощи в проведении уборки жилых помещений.', '["Спец. одежда"]', '["Инвентарь для  уборки;","Тара для мусора;","Моющие средства."]', '["сухая уборка полов спальной комнаты и кухни","влажная уборка полов спальной комнаты и кухни","сухая и (или) влажная уборка от пыли мебели, подоконников в спальной комнате и кухне","вынос бытового мусора (кроме строительного и крупногабаритного)"]', '["аккуратность сухой и влажной уборки полов спальной комнаты и кухни","своевременность сухой и влажной уборки полов спальной комнаты и кухни","аккуратность и своевременность сухой и (или) влажной уборки от пыли мебели, подоконников в спальной комнате и кухне","аккуратность и своевременность выноса бытового мусора"]', 30, NULL, 157.50, NULL, 6, '0115', 1, NULL, 1, 1, 1, 1, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (9, 'Содействие в осуществлении платы за жилое помещение и коммунальные услуги, услуги связи (в том числе снятие показаний приборов учета потребления тепловой энергии, горячей и холодной воды, газа, заполнение квитанций и оплата по счетам).', '["Возможно использование электронного устройства"]', '["Денежные средства"]', '["снятие и передача в уполномоченные организации показаний с приборов учета потребления тепловой энергии, горячей и холодной воды, газа","оформление документов на оплату (перерасчет оплаты)  жилых помещений, коммунальных услуг, услуг связи","получение наличных денежных средств от получателя социальной услуги для оплаты за жилое помещение, коммунальных услуг, услуг связи","оплата за жилое помещение, коммунальных услуг, услуг связи","окончательный расчет с получателем социальной услуги по квитанции"]', '["точность снятия показаний с приборов учета потребления тепловой энергии, горячей и холодной воды, газа","аккуратность оформления документов на оплату жилого помещения, коммунальных услуг, услуг связи","своевременность (в день получения наличных денежных средств от получателя социальных услуг) внесения наличных денежных средств в счет оплаты за жилое помещение, коммунальных услуг, услуг связи"]', 60, NULL, 315.00, NULL, 2, '0119', 1, NULL, 1, 1, 2, 2, 0, 0);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (22, 'Посещение получателей социальных услуг, находящихся в медицинских организациях в стационарных условиях.', '["Тара для доставки заказанных товаров"]', '["Денежные средства"]', '["посещение в стационарных медицинских организациях в часы приема","оказание морально-психологической поддержки","доставка за счет получателя социальных услуг книг, периодических изданий, не запрещенных в стационарной медицинской организации продуктов питания, иных предметов первой необходимости"]', '["своевременность посещение в стационарной медицинской организации","своевременность оказания морально-психологической поддержки","своевременность доставки за счет получателя социальных услуг книг, периодических изданий, не запрещенных в стационарной медицинской организации продуктов питания, иных предметов первой необходимости"]', 120, NULL, 630.00, NULL, 8, '1211', 1, NULL, 1, 2, 2, 2, 0, 1);
INSERT INTO public.service (id, name, agency_resources, client_resources, description, result, "time", comment, price, price_hour, category_id, code, type_id, path, location_type_id, level, periodicity_id, frequence, state, urgent) VALUES (21, 'Содействие в госпитализации в медицинские организации, сопровождение в медицинские организации.', NULL, NULL, '["сбор документов, необходимых для госпитализации","помощь в сборе вещей перед госпитализацией","вызов специализированного автотранспорта","сопровождение получателя социальных услуг в медицинские организации Москвы в рабочее время"]', '["своевременность сбора документов, необходимых для госпитализации","аккуратность сбора вещей перед госпитализацией","своевременность вызова специализированного автотранспорта"]', 120, NULL, 630.00, NULL, 8, '1210', 1, NULL, 1, 2, 4, 1, 0, 1);
